INSERT INTO `business_settings` VALUES (1,'cash_on_delivery','{\"status\":\"1\"}','2021-07-01 15:51:17','2021-07-01 15:51:17'),(2,'stripe','{\"status\":\"0\",\"api_key\":null,\"published_key\":null}','2021-05-11 03:57:02','2022-03-23 04:22:00'),(4,'mail_config','{\"status\":\"1\",\"name\":\"Streetside\",\"host\":\"smtp.mailgun.org\",\"driver\":\"smtp\",\"port\":\"587\",\"username\":\"no-reply@mg.streetsideapp.com\",\"email_id\":\"no-reply@streetsideapp.com\",\"encryption\":\"ssl\",\"password\":\"Jediyah123$%\"}',NULL,'2023-12-11 15:02:26'),(5,'fcm_project_id','streetsideco',NULL,NULL),(6,'push_notification_key','AAAARPfGyIw:APA91bEG9uthG0U9HQFKCV9FKz1AgDDPUPY6Q-sEYEqKwgavfeMygTttpc1NK-8b71TZyVxgU2JwZwy-fx98vE96dzJJsN2ODu8CUjeL93lclSwLVhiUejvvnqrHXICWhf1_fTq-T1-X',NULL,NULL),(7,'order_pending_message','{\"status\":1,\"message\":\"Your order is successfully placed\"}',NULL,NULL),(8,'order_confirmation_msg','{\"status\":1,\"message\":\"Your order is confirmed\"}',NULL,NULL),(9,'order_processing_message','{\"status\":1,\"message\":\"Your order is started for cooking\"}',NULL,NULL),(10,'out_for_delivery_message','{\"status\":1,\"message\":\"Your food is ready for delivery\"}',NULL,NULL),(11,'order_delivered_message','{\"status\":1,\"message\":\"Your order is delivered\"}',NULL,NULL),(12,'delivery_boy_assign_message','{\"status\":1,\"message\":\"Your order has been assigned to a delivery man\"}',NULL,NULL),(13,'delivery_boy_start_message','{\"status\":1,\"message\":\"Your order is picked up by delivery man\"}',NULL,NULL),(14,'delivery_boy_delivered_message','{\"status\":1,\"message\":\"Order delivered successfully\"}',NULL,NULL),(15,'terms_and_conditions','<p>Thank you for your interest in the Streetside application( Streetside Stores, Streetside Restaurant, Streetside Delivery, or Streetside Manager) for your mobile device (the &ldquo;App&rdquo;) provided to you by Streetside Co. (&ldquo;Streetside&rdquo;, &ldquo;us&rdquo; or &ldquo;we&rdquo;), and our web site at<a href=\"https://www.streetsideco.com/\">&nbsp;Streetsideco.com</a>&nbsp;(the &ldquo;Site&rdquo;), as well as all related web sites, networks, and downloadable software provided by us and on which a link to these Terms of Service is displayed (collectively, together with the App and Site, our &ldquo;Platform&rdquo;). These Terms of Service (these &ldquo;Terms&rdquo;), including the Privacy Policy incorporated into these Terms by reference and any other applicable policies and guidelines, as may be updated from time to time, govern your use of the Platform. These Terms constitute a legal agreement between you and Streetside. In order to use the Platform you must agree to these Terms.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>All references to &ldquo;you&rdquo; or &ldquo;your,&rdquo; as applicable, mean the person who accesses, uses, and/or participates in the Platform in any manner, and each of your heirs, assigns, and successors. If you use the Platform on behalf of an entity, organization, or company, you represent and warrant that you have the authority to bind that entity to these Terms, your acceptance of the Terms will be deemed an acceptance by that entity, and &ldquo;you&rdquo; and &ldquo;your&rdquo; herein shall refer to that entity.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>BY DOWNLOADING, INSTALLING, OR OTHERWISE ACCESSING OR USING THE PLATFORM, YOU AGREE THAT YOU HAVE READ, UNDERSTOOD, AND AGREE TO BE BOUND BY THESE TERMS. IF YOU DO NOT AGREE, YOU MAY NOT USE THE PLATFORM.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>STREETSIDE PLATFORM</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform connects consumers with retail stores, and restaurants (&ldquo;Merchants&rdquo;), and with independent contractor couriers (&ldquo;Couriers&rdquo;), to facilitate on-demand delivery or pickup services. Through the Platform, consumers may request that merchandise or food be made available for pick-up or delivered to them from a Merchant by Couriers who contract with Streetside to access the Platform and receive delivery opportunities.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside is not a retail store, restaurant, food delivery platform, merchandise delivery platform or food preparation entity. Streetside is not liable or responsible for Merchants&rsquo; compliance with applicable federal, state, or local laws, rules, regulations or standards pertaining to their businesses. In addition, Streetside does not guarantee the quality of what Merchants sell and does not independently verify, and is not liable for, representations made by Merchants regarding their products on the Platform.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside is not the retailer of any products offered by Merchants, nor is it in the delivery business or a common carrier. Streetside provides a technology platform facilitating the transmission of orders by consumers to Merchants for pickup or delivery by Couriers. Couriers are independent contractors and not employees, partners, agents, joint ventures, or franchisees of Streetside. Couriers have entered into independent contractor agreements with Streetside, which require them to comply with all applicable federal, state, and local laws, rules and regulations. Streetside shall not be liable or responsible for any delivery services provided by Couriers, or any errors or misrepresentations made by any of them. You hereby acknowledge that Streetside does not supervise, direct, control, or monitor a Courier&rsquo;s provision of services and expressly disclaims any responsibility or liability for the services performed.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside is committed to ensuring that the merchandise or food ordered by a consumer is delivered in a manner consistent with consumer&rsquo;s expectation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As provided in greater detail in these Terms, you agree and acknowledge these material terms:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The Platform is licensed, not sold to you, and you may use the Platform only as set forth in these Terms;</li>\r\n	<li>Your use of the Platform may be subject to separate third party terms of service and fees, including without limitation your mobile network operator&rsquo;s (&ldquo;Carrier&rdquo;) terms of service and fees, including fees charged for data usage and overage, which are your sole responsibility;</li>\r\n	<li>You consent to the collection, sharing, and use of your personally identifiable information in accordance with Streetside&rsquo;<a href=\"https://postmates.com/legal/privacy\" target=\"_blank\">&nbsp;Privacy Policy</a>;</li>\r\n	<li>The Platform is provided &ldquo;as is&rdquo; without warranties of any kind, and Streetside&rsquo; liability to you is limited; and</li>\r\n	<li>Disputes arising under these Terms will be resolved by binding individual arbitration.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>1. Eligibility</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You must be at least eighteen (18) years old to use the Platform. By agreeing to these Terms, you represent and warrant to us: (1) That you are at least eighteen (18) years old; (2) That you have not previously been suspended, banned, or removed from the Platform; and (3) That your registration and your use of the Platform is in compliance with any and all applicable laws and regulations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>2. Accounts and Registration</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>To access some features of the Platform, you must register for an account. When you register for an account, you may be required to provide us with some information about yourself (such as your name, credit card information, e-mail address, phone number, profile image, or other contact information). You agree that the information you provide to us is accurate, current, and complete, and that you will keep it up-to-date at all times. When you register, you will be asked to provide a password. You are solely responsible for maintaining the confidentiality of your account and password, and any password for Facebook, Google, or other third-party login when available. You accept responsibility for all activities that occur under your account. Streetside will not be liable and you may be liable for losses, damages, liability, expenses, and lawyers&rsquo; fees incurred by Streetside or a third party arising from someone else using your account due to your conduct regardless of whether you have notified us of such unauthorized use. You understand and agree that we may require you to provide information that may be used to confirm your identity and help ensure the security of your account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>3. Scope of License</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform is licensed, not sold, to you for use only under the terms of this license. Streetside reserves all rights not expressly granted to you. Subject to your complete and ongoing compliance with these Terms, Streetside hereby grants you a personal, limited, non-sublicensable, non-transferable, and revocable license to access the Platform on compatible devices that you own or control, solely for your own personal, non-commercial use, and only in a manner that complies with all legal requirements that apply to you or your use of the Platform. Streetside may revoke this license at any time, in its sole discretion.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You may not modify, alter, reproduce, distribute or make the App available over a network where it could be used by multiple devices at the same time. You may not rent, lease, lend, sell, redistribute or sublicense the App. If you breach these license restrictions, or otherwise exceed the scope of the license granted in these Terms, you may be subject to prosecution and legal damages, as well as liability for infringement of intellectual property rights. These Terms will govern any updates provided to you by Streetside that replace and/or supplement the original App, unless the upgrade is accompanied by a separate license in which case the terms of that license will govern.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>4. Payment Terms</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4.1. General Payment Terms</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Platform</em></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You understand that the prices for product or menu items displayed through the Platform may differ from the prices offered or published by Merchants for the same product or menu items and/or from prices available at other third-party websites/mobile applications. Prices for product or menu items displayed through the Platform may not be the lowest prices at which the product or menu items are sold.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Because of the nature of the Platform, Streetside does not always know how much a Merchant will charge for a particular product or menu item. Where your cart includes product or menu items for which Streetside does not know the exact price to be charged by the Merchant, Streetside may designate an estimated subtotal for such product and menu items (the &ldquo;Estimated Subtotal&rdquo;). Similarly, where Streetside does not know the exact price of certain or all fees associated with the order, including any applicable taxes and/or Streetside fees, we may designate an estimate for such fees (the &ldquo;Estimated Fees&rdquo;). If you have included product or menu items in your cart that are subject to Estimated Subtotal and/or Estimated Fees, we will provide you with an estimated total. Merchants may charge more or less than the Estimated Subtotal for products or menu items you order. Similarly, we may charge more or less than the Estimated Fees based upon the final prevailing price of Merchant&rsquo;s goods. In some cases, we may not be able to provide Estimated Subtotal or Estimated Fees, such as when the merchandise cost is unknown or we are otherwise unable to predict fees. Streetside reserves the right to determine final prevailing pricing of all product or menu items ordered through the Platform. In cases in which prevailing pricing is different than the Estimated Subtotal and/or Estimated Fees, what you are ultimately charged may be different than the estimated total. You acknowledge and agree to pay the prevailing pricing and fees, even if they differ from the Estimated Subtotal and/or Estimated Fees.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Certain features of the Platform, including placing orders, may require you to pay fees to Streetside. Streetside may change, or add, fees for use of our Platform at any time as we deem necessary or appropriate for our business, and we may incorporate certain fees into the price of products or menu items. You will have an opportunity to review and accept an estimate of the fees and other pricing that you will be charged, as applicable. The final fees may differ from the estimate. In all cases, you acknowledge and accept that a fee will be charged and you agree to pay said fee.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside has no obligation to itemize its costs, Estimated Fees, profits or margins when publishing prices on the Platform and reserves the right to change such prices at any time, at its discretion. You are liable for all transaction taxes on the Platform provided under these Terms (other than taxes based on Streetside income).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside will charge the payment method you specify at the time of purchase or as otherwise specified by you in your account information. We may also place a pre-authorization hold on your payment method, as described in Section 4.3.&nbsp;Charges paid by you are final and non-refundable, except as expressly provided in Section 4.2, and will be quoted in the local currency of the location where the order is being delivered or picked up. Except as expressly provided in Section 4.2, Streetside has no obligation to provide refunds or credits. However, Streetside, in its sole discretion, may provide consumers with refunds, courtesy delivery or product credits, or make promotional offers with different features and different rates to any consumers, which are subject to these Terms (see Credits section below).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Promotional Offers and Credits.</em></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Promotional Offers. Streetside, in its sole discretion, may make promotional offers with different features and different rates to any consumer. These promotional offers are subject to these Terms and may be valid only for certain consumers as indicated in the offer. A consumer must have a valid Streetside account with a valid form of accepted payment on file to take advantage of a promotional offer. You agree that promotional offers: (i) may only be used by the intended audience, for the intended purpose, and in a lawful manner; (ii) may not be duplicated, sold or transferred in any manner, or made available to the general public, unless expressly permitted by Streetside; (iii) are subject to the specific terms that Streetside establishes for such promotional offer; (iv) cannot be redeemed for cash or cash equivalent; (v) may only be applied if all qualifying conditions are met; and (vi) are not valid for use after the date indicated in the offer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Promotional offers can only be redeemed for Streetside orders on Streetside apps with the latest version, and within areas and times that Streetside Platform is available. Promotional offers are non-transferrable, may not be resold, and are not redeemable for cash, cash equivalent or other consideration. Offers cannot be applied retroactively for prior purchases and cannot be combined unless otherwise indicated. You agree we may change the terms and conditions of an offer, terminate an offer, or expire, withhold, deduct, limit, or modify an offer at any time for any reason. Streetside reserves the right to withhold or deduct credits or benefits obtained through a promotion in the event that Streetside determines or believes that the redemption of the promotion or receipt of the credit or benefit was in error, fraudulent, illegal, or in violation of the applicable promotion terms or these Terms. Streetside reserves the right to modify or cancel an offer at any time. The offer-redeeming consumer is responsible for paying any applicable sales tax related to the use of an offer. Streetside has no obligation for payment of any tax in conjunction with the distribution or use of any Offer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If your account is cancelled for any or no reason, you may forfeit any pending, current, or future credits or promotional offers and any other forms of unredeemed value in or associated with your account without prior notice to you.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.2. Payment Authorization</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You authorize Streetside to charge all sums for orders that you make to the payment method designated in your account. If there is a problem charging your selected payment method, we may charge any other valid payment method associated with your account. When you place an order through Streetside, a temporary pre-authorization hold is placed on your designated payment method to verify that the card is valid and has funds available for your intended purchase. The amount of this pre-authorization hold may be greater or less than the order total quoted at checkout. However, your payment will be captured up to 24 hours after your order is completed or cancelled. In the event that the pre-authorization is greater than the final amount, the difference will be released after your order is completed or cancelled; depending on your bank, it may take up to 5 business days to receive access to these released funds. In the event that the pre-authorization is lower than the final amount, we will either authorize an increase in the original amount or, if unsuccessful, we will capture the increase in amount owed by you in a second authorization.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside also places an initial temporary pre-authorization hold on each new payment method you add to your account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside reserves the right to request additional information from you if we have reason to believe, in our sole discretion, that a payment method may be fraudulent.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.3. Delinquent Accounts</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If payment due on your account is delinquent, we reserve the right to suspend or terminate your access to the Platform; your account information may be sent to a collection agency/debt collector and you may be subject to a collection action, and payment of collection related fees and costs. You will be responsible for paying all past due amounts.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If your payment card expires or is replaced by your issuing bank, the card network may provide us with updated card details associated with the same account. We may use these new details in order to help prevent any interruption to the Platform. If you would like to use a different payment method, please visit your account settings to update your billing information. In addition, we may charge another stored payment card if your default payment is declined or no longer available to us.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.4. Consumer Not Available</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside reserves the right to charge you the full order amount, including any Streetside fees, if you are not at the designated delivery location when the Courier arrives to complete the delivery or if you fail to pick up an order from a Merchant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.5. Cancelled Orders</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you cancel your order, you may be charged depending on what stage the order was in when you cancelled. You will be notified of any applicable charges before you complete your cancellation.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.6. Returned Items</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If an item has to be returned for any reason, you may be subject to a non-refundable $15 return/restocking fee. For alcohol items, the Courier reserves the right, at his or her discretion, to refuse delivery and return the item(s) if the name on your ID does not match the name on your order, if you are not at least twenty-one (21) years old (&ldquo;Legal Age&rdquo;), if you cannot provide a bona-fide government-issued photo identification that shows you are of Legal Age, or if you are visibly intoxicated.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4.7.&nbsp;Merchant Fees</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There is no signup fee to get a Merchant account set up. For the scope of the soft launch, there will be a per order fee of $0.75 BZD for every order placed on the platform, whether pick-up or delivery. For example, Jane orders five $10 wings combo from Drey&rsquo;s wings for herself and her family, this is one order. This will be one order for five $10 wings combo. So this will help to have people bundle and get orders in bulk delivery fees will vary based on the amount. Fees will be adjusted accordingly after the launch.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4.8.&nbsp;Courier Fees</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There is no signup fee to get a Courier account set up. For the scope of the soft launch, there will be a per order fee of $0.50 BZD for every delivery on the platform. Couriers with a Service store on the platform can have a merged price of $1.25 per order made on the platform. These services include bank runs, private pickup, grocery pickup, market runs, other errands supported/specified on the platform.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>5. Third-Party Interactions</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5.1. Third-Party Providers</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>During use of the Platform, you may purchase goods and services from third-party Merchants through the Platform. Any such activity, and any interactions, disputes, terms, conditions, warranties or representations associated with that activity, is solely between you and the applicable third-party Merchant. Streetside and its licensors shall have no liability, obligation or responsibility for any purchase or transaction between you and any third-party provider. In no event shall Streetside or its licensors be responsible for any content, products, services or other materials on or available from third-party sites or third-party providers. Certain third-party providers of goods and/or services may require your agreement to additional or different terms and conditions prior to your use of or access to such goods or services, and Streetside disclaims any and all responsibility or liability arising from such agreements between you and a third party.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>5.2. Couriers</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform enables you to engage third-party Couriers to provide delivery services. Any interactions or disputes between you and a Courier are solely between you and that Courier. Streetside and its licensors shall have no liability, obligation or responsibility for any interaction between you and any Courier.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>5.3. Third-Party Advertising</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform may contain third-party advertising and marketing. By agreeing to these Terms you agree to receive such advertising and marketing.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>5.4. Third-Party Terms</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Parts of the Platform may include Google Maps features and content, including the Google Maps API(s). Your use of Google Maps is subject to the<a href=\"https://maps.google.com/help/terms_maps.html\" target=\"_blank\">&nbsp;Google Maps/Google Earth Additional Terms of Service</a>&nbsp;and the<a href=\"https://www.google.com/policies/privacy/\" target=\"_blank\">&nbsp;Google Privacy Policy</a>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>6. Your Use of the Platform</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In order to use the Platform, you agree to the following:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The Platform, including any content that forms part of the Platform, contains proprietary content, information and material that is protected by applicable intellectual property and other laws, including copyright;</li>\r\n	<li>You will not violate, or encourage others to violate, any right of a third party, including by infringing or misappropriating any third-party intellectual property right, or otherwise engage in the unauthorized use of any proprietary content, information or materials;</li>\r\n	<li>Unless expressly permitted, you may not alter, modify, create derivative works of, sell, license or in any way exploit any part of the Platform, and you agree not to copy, reproduce, distribute, publish, display, perform, transmit, stream or broadcast any part of the Platform without prior written authorization;</li>\r\n	<li>You agree not to bypass any security or other features of the Platform designed to control the manner in which the Platform is used, harvest or mine content from the Platform, or otherwise access or use the Platform in a manner inconsistent with individual human use;</li>\r\n	<li>You agree not to perform any fraudulent activity, including impersonating any person or entity, or accessing any other Platform account without permission;</li>\r\n	<li>You agree not to decipher, reverse engineer, decompile or disassemble the Platform, or the software used to provide the Platform, in whole or in part, or authorize, direct, or cause a third party to do so;</li>\r\n	<li>You agree not to use, display, mirror, frame or utilize framing techniques to enclose the Platform, or any portion thereof, unless and solely to the extent Streetside makes available the means for embedding any part of the Platform;</li>\r\n	<li>You agree not to access, tamper with, or use non-public areas of the Platform, Streetside&rsquo; (and its hosting company&rsquo;s) computer systems and infrastructure, or the technical delivery systems of Streetside&rsquo; providers;</li>\r\n	<li>You agree not to use any robot, spambot, spider, crawler, scraper or other automated means or interface not provided by us to access the Platform or to extract data;</li>\r\n	<li>You agree not to use the Platform in any manner to harass, abuse, stalk, threaten, defame or otherwise infringe or violate the rights of any other party, and that Streetside is not in any way responsible for any such use by you, nor for any harassing, threatening, defamatory, offensive or illegal messages or transmissions that you may receive as a result of using the Platform;</li>\r\n	<li>You agree that your use of the Platform may incur third-party fees, such as fees charged by your Carrier for data usage, and may be subject to third-party terms, such as your Carrier&rsquo;s terms of service, and you agree to pay all such fees and abide by all such terms; and</li>\r\n	<li>You agree not to introduce viruses, time-bombs, worms, cancelbots, trojan horses and/or other harmful code into the Platform.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Transactions involving Alcohol.</strong>&nbsp;Alcoholic beverages (including but not limited to beer, wine, cider, and spirits, as applicable; all referred to as &ldquo;Alcoholic Beverages&rdquo;) may only be purchased by consumers who are of Legal Age in jurisdictions that permit such purchase. If you are a consumer, you expressly represent and warrant that: (i) you are of Legal Age; and (ii) you will provide bona fide government-issued photo identification to your Courier upon delivery to you. Valid forms of identification include but are not limited to: (i) a valid motor vehicle operator&rsquo;s license, (ii) a passport issued by the U.S. or by a foreign government, or (iii) a valid identification card issued to a member of the Armed Forces that includes a date of birth and a picture, showing your Legal Age. Deliveries of Alcoholic Beverages may not be made to anyone who is intoxicated, regardless of his or her age. You further understand and acknowledge that neither Streetside nor the Courier can accept your order of Alcoholic Beverages, and the order will only be delivered if the third-party Merchant accepts your order.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You agree not to do any of the acts described in this Section 6, or to assist or permit any person in engaging in any of the acts described in this Section 6.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>7. Consent to Use of Data</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please see Streetside&rsquo;s Privacy Policy, for more information regarding information Streetside collects, and how it uses and shares that information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have previously instructed Streetside to share your personal information with a Merchant or any other third party, you can elect to discontinue such sharing by directly messaging any of the social media pages or contact information provided on the website.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>8. Intellectual Property Ownership</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform, and the media and materials contained in the Platform, including all intellectual property rights in the Platform, are the sole and exclusive property of Streetside and its licensors. Except for the limited license expressly granted by and to you under these Terms, no other rights, licenses, or immunities are granted or shall be deemed to be granted under these Terms, either expressly, or by implication, estoppel or otherwise. All rights not expressly granted by Streetside in these Terms are expressly reserved.</p>\r\n\r\n<p>&nbsp;</p>