use of the Platform. If you change or deactivate the phone number you provided to Streetside, you must update your account information to help prevent us from inadvertently communicating with anyone who acquires your old number. Standard data and message rates may apply for SMS and MMS alerts, whether you send or receive such messages. Please contact your Carrier for details.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>10.2. Push Notifications</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When you install our App on your mobile device you agree to receive push notifications, which are messages an app sends you on your mobile device even when the app is not on. You can turn off notifications by visiting your mobile device&rsquo;s &ldquo;settings&rdquo; page.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>10.3. Email</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside may send you emails concerning our products and services, as well as those of third parties. You may opt-out of promotional emails by following the unsubscribe instructions in a promotional email.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>11. Indemnity</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You are responsible for your use of the Platform, and you agree to defend (at Streetside&rsquo; option), indemnify, and hold harmless Streetside and its officers, directors, employees, contractors, consultants, affiliates, investors, service providers, business partners, subsidiaries and agents from and against every claim, liability, damage, loss, and expense, including reasonable attorneys&rsquo; fees and costs, arising out of or in any way connected with:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Your violation of any of these Terms, any representati