ERGEN INFORMATION.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>STREETSIDE DOES NOT WARRANT, ENDORSE, GUARANTEE, OR ASSUME RESPONSIBILITY FOR ANY PRODUCT OR PLATFORM ADVERTISED OR OFFERED BY A MERCHANT OR OTHER THIRD PARTY THROUGH THE PLATFORM OR ANY HYPERLINKED WEBSITE OR THIRD-PARTY SERVICE, AND STREETSIDE WILL NOT BE A PARTY TO OR IN ANY WAY MONITOR ANY TRANSACTION BETWEEN YOU AND THIRD-PARTY PROVIDERS OF PRODUCTS OR SERVICES.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>13. Limitation of Liability</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>IN NO EVENT SHALL STREETSIDE AND/OR ITS LICENSORS BE LIABLE TO ANYONE FOR ANY INDIRECT, PUNITIVE, SPECIAL, EXEMPLARY, INCIDENTAL, CONSEQUENTIAL OR OTHER DAMAGES OF ANY TYPE OR KIND (INCLUDING PERSONAL INJURY, LOSS OF DATA, REVENUE, PROFITS, REPUTATION, USE OR OTHER ECONOMIC ADVANTAGE) EVEN IF STREETSIDE AND/OR ITS LICENSORS HAVE BEEN PREVIOUSLY ADVISED OF THE POSSIBILITY OF SUCH DAMAGES.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>THIS LIMITATION OF LIABILITY SECTION APPLIES FULLY IN ALL STATES, INCLUDING RESIDENTS OF NEW JERSEY.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>THE PLATFORM CONNECTS YOU TO COURIERS AND MERCHANTS FOR THE PURPOSES OF FACILITATING COURIER AND PRODUCT FULFILLMENT SERVICES. STREETSIDE WILL NOT ASSESS THE SUITABILITY, LEGALITY OR ABILITY OF ANY COURIERS OR MERCHANTS, AND YOU EXPRESSLY WAIVE AND RELEASE STREETSIDE FROM ANY AND ALL LIABILITY, CLAIMS OR DAMAGES ARISING FROM OR IN ANY WAY RELATED TO THE COURIERS OR MERCHANTS. STREETSIDE WILL NOT ASSESS THE QUALITY, SAFETY, OR LEGALITY OF THE ITEMS PROVIDED BY MERCHANTS ON THE PLATFORM, AND YOU EXPRESSLY WAIVE AND RELEASE STREETSIDE FROM ANY AND ALL LIABILITY, CLAIMS OR DAMAGES ARISING FROM OR IN ANY WAY RELATED TO MERCHANTS, AND THE ITEMS THEY PROVIDE. STREETSIDE WILL NOT BE A PARTY TO DISPUTES OR NEGOTIATIONS OF DISPUTES, BETWEEN YOU AND ANY COURIERS, OR MERCHANTS. RESPONSIBILITY FOR THE DECISIONS YOU MAKE REGARDING SERVICES OFFERED VIA THE PLATFORM (WITH ALL THEIR IMPLICATIONS) RESTS SOLELY WITH YOU. IN ADDITION, WE WILL NOT ASSESS THE SUITABILITY, LEGALITY OR ABILITY OF ANY THIRD PARTIES, AND YOU EXPRESSLY WAIVE AND RELEASE STREETSIDE FROM ANY AND ALL LIABILITY, CLAIMS, CAUSES OF ACTION, OR DAMAGES ARISING FROM YOUR USE OF THE PLATFORM, OR IN ANY WAY RELATED TO THE THIRD PARTIES INTRODUCED TO YOU BY THE PLATFORM.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>14. Notice</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside may give notice by any means of communication reasonably anticipated to notify you of the information provided. You agree that all notices, disclosures, and other communications that we provide to you electronically satisfy any legal requirement that such communications be in writing or be delivered in a particular manner. You agree that you have the ability to store such electronic communications such that they remain accessible to you in an unchanged form. By way of example only, such communication may be a general notice on the Platform or via email to the email address listed on your Streetside account. It is your obligation to update your account information so that we may contact you as may be necessary. Such notice shall be deemed to have been given 48 hours after dispatch. If physical notice (e.g., BPMS) is used, then such notice shall be deemed to have been given 7 days after dispatch.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Except as explicitly described in the Dispute Resolution and Arbitration section, you may give notice to Streetside (such notice shall be deemed given when received by Streetside) at any time by any of the following: letter delivered by nationally recognized overnight delivery service or first class postage prepaid mail to the Streetside Office.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>15. Assignment</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You may not assign or transfer these Terms or your rights under these Terms, in whole or in part, by operation of law or otherwise, without our prior written consent. We may assign these Terms in whole or in part at any time to any entity without your notice or consent. Any purported assignment by you in violation of this section shall be void.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>16. Term and Termination of Agreement</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>These Terms are effective until terminated by you or Streetside as described below. Your rights under these Terms will terminate automatically without notice from Streetside if you fail to comply with any of these Terms (including by violating any license restriction contained in these Terms). In addition, Streetside may in its sole discretion terminate your user account on the Platform or suspend or terminate your access to the Platform at any time without notice. We also reserve the right to modify or discontinue the Platform at any time (including by limiting or discontinuing certain features of the Platform) without notice to you. We will have no liability whatsoever on account of any change to the Platform or any suspension or termination of your access to or use of the Platform. You may terminate these Terms at any time by closing your account, uninstalling the App, and ceasing use of the Platform. Sections 4.4, 5, 7-17, and 19-21 survive termination of your account or these Terms.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>17. Modification of these Terms</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Except as explicitly described in the Dispute Resolution and Arbitration section, we reserve the right to update or modify the Terms at any time without prior notice, and such changes will be effective immediately upon being posted through the Platform, except as set forth below. These Terms identify the date of last update. Except as explicitly described in the Dispute Resolution and Arbitration section, your use of the Platform following any such change constitutes your agreement to be bound by the modified Terms. In the case of material changes to these Terms, we will make reasonable efforts to notify you of the change, such as through sending an email to the address you may have used to register for an account, through a pop-up window on the Platform, or other similar mechanism.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You acknowledge and agree that if Streetside modifies any provision of these Terms (including any information referenced at hyperlinks), other than the Dispute Resolution and Arbitration section herein, you will not have a renewed opportunity to opt out of arbitration. You further acknowledge and agree that unless the Dispute Resolution and Arbitration section herein is materially different from any prior arbitration provision with Streetside to which you may be bound, your acceptance of these Terms does not create a renewed opportunity to opt out of arbitration (if applicable).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Except as explicitly described in the Dispute Resolution and Arbitration section, material changes to these Terms will be effective upon the earlier of: (1) Your first use of the Platform with actual notice of such change, or (2) thirty (30) days from posting of such change.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Disputes arising under these Terms will be resolved in accordance with the version of the Terms in place at the time the dispute arose. We encourage you to review these Terms frequently to stay informed of the latest modifications.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>18. Confidentiality</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You acknowledge and agree that when using the Platform, you may have direct or indirect access or exposure to Streetside&rsquo;s confidential information (&ldquo;Confidential Information&rdquo;). Confidential Information includes Streetside&rsquo;s data, provider IDs, user information, delivery recipient information, delivery provider information, package information, and the transaction volume, marketing and business plans, business, financial, technical, operational and such other nonpublic information (whether disclosed in writing or verbally) that Streetside designates as being proprietary or confidential or that you should reasonably know to treat as confidential.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You acknowledge and agree that: (1) all Confidential Information shall remain the exclusive property of the Streetside; (2) you shall not use Confidential Information for any purpose except in furtherance of your use of the Platform; (3) you shall not disclose Confidential Information to any third party; and (d) you shall not store or keep Confidential Information and shall return or destroy (with confirmation of destruction) all Confidential Information upon the termination of your use of the Platform or at the request of Streetside.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Notwithstanding the foregoing, Confidential Information shall not include any information to the extent it: (1) is or becomes part of the public domain through no action or omission by you; (2) was possessed by you prior to your use of the Platform without an obligation of confidentiality; or (3) is disclosed to you by a third party having no obligation of confidentiality with respect thereto.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>19. General</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Governing Law. These Terms are governed by the laws of Belize without regard to conflict of law principles. If a lawsuit or court proceeding is permitted under these Terms, you and Streetside agree to submit to the personal and exclusive jurisdiction of the state courts and federal courts located within Belize for the purpose of litigating any Dispute. We operate the Platform from our office in Belize, and we make no representation that materials included in the Platform are appropriate or available for use in other locations. No joint venture, partnership, employment, or agency relationship exists between you, Streetside or any third-party provider as a result of the Terms or use of the Platform.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Waiver and Severability. Except as explicitly described in the Dispute Resolution and Arbitration section, if any provision of these Terms is held to be invalid or unenforceable, such provision shall be struck and the remaining provisions shall be enforced to the fullest extent under law. The failure of Streetside to enforce any right or provision in these Terms shall not constitute a waiver of such right or provision unless acknowledged and agreed to by Streetside in writing.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Entire Agreement. These Terms comprise the entire agreement between you and Streetside and supersedes all prior or contemporaneous negotiations, discussions or agreements, whether written or oral, between the parties regarding the subject matter contained in these Terms.</p>',NULL,'2023-05-29 23:52:57'),(16,'business_name','Streetside',NULL,NULL),(17,'currency','BZD',NULL,NULL),(18,'logo','2023-05-30-647589faa0b32.png',NULL,NULL),(19,'phone','6205821',NULL,NULL),(20,'email_address','support@streetsideco.com',NULL,NULL),(21,'address','North Bullet Tree',NULL,NULL),(22,'footer_text','@2024',NULL,NULL),(23,'customer_verification','0',NULL,NULL),(24,'map_api_key','AIzaSyBrRBaIQIK-0ndxc5n8mD389VSGuQI05iI',NULL,NULL),(25,'about_us','<p><strong>About Streetside</strong></p>\r\n\r\n<p>Welcome to Streetside, your trusted partner for seamless online shopping and delivery services in Belize. At Streetside, we connect people with the best local businesses in their neighborhoods, making it easy and convenient for customers to shop and receive their desired products right at their doorstep. We strive to empower local businesses, create new earning opportunities, and enhance the way people live, work, and shop.</p>\r\n\r\n<p><strong>Our Mission</strong></p>\r\n\r\n<p>At Streetside, our mission is to provide tools and services that simplify the process of ordering and delivering products. We collaborate with businesses across Belize, partnering with them to establish online stores that allow customers to shop safely and effortlessly. Through cutting-edge tracking technology, we keep everyone informed throughout the entire order and delivery process, ensuring a seamless and reliable experience.</p>\r\n\r\n<p><strong>What We Offer</strong></p>\r\n\r\n<p>Streetside is an e-commerce ecosystem designed to facilitate convenient transactions between customers, businesses, and delivery drivers. We offer a comprehensive solution that combines a user-friendly online platform, efficient delivery networks, and a range of business categories to meet diverse customer needs. Whether you&#39;re craving delicious food or refreshing drinks, or in need of errand services, pet supplies, groceries, pharmacy products, or courier services, Streetside has you covered.</p>\r\n\r\n<p><strong>How It Works</strong></p>\r\n\r\n<p>At Streetside, we have designed a streamlined process to ensure a seamless shopping and delivery experience for our customers and businesses. Here&#39;s how it works:</p>\r\n\r\n<p>1. **Customer Places an Order:** Customers browse through the available stores on our platform and select their desired items. They place an order from a single store at a time, adding items to their cart and providing necessary details like delivery address and payment method.</p>\r\n\r\n<p>2. **Order Request and Delivery Assignment:** Once the customer places an order, it appears in the order request section. Our efficient delivery team immediately receives the notification and can choose to accept the delivery assignment.</p>\r\n\r\n<p>3. **Store Confirmation and Order Preparation:** After the delivery driver accepts the order, the store owner receives the order details on their store dashboard. They start preparing the order, cooking the food, or assembling the items. If the order is digitally paid, it will directly go into the confirmed status, and the store can begin the preparation process without waiting for the delivery driver&#39;s confirmation.</p>\r\n\r\n<p>4. **Delivery Confirmation and Handover:** Upon confirmation by the delivery driver (if Cash-on-Delivery), they proceed to pick up the order from the store. The store owner hands over the prepared items to the delivery driver for immediate delivery to the customer.</p>\r\n\r\n<p>5. **Delivery to the Customer:** The delivery driver, equipped with the order and necessary instructions, proceeds to deliver the order to the customer&#39;s provided delivery address. They ensure the items are delivered promptly and in excellent condition.</p>\r\n\r\n<p>6. **Self-Pickup and Schedule Orders:** For self-pickup orders, the store manages all the steps from order confirmation to preparation and pickup. In the case of scheduled orders, all the necessary operations begin 15 minutes before the scheduled delivery time, ensuring timely fulfillment.</p>\r\n\r\n<p>At Streetside, we strive to provide a smooth and efficient process that prioritizes customer satisfaction and enables businesses to deliver their products promptly. Our technology-driven platform ensures transparency and effective coordination between customers, stores, and delivery drivers, resulting in a seamless ordering and delivery experience.</p>\r\n\r\n<p><strong>Our Commitment</strong></p>\r\n\r\n<p>At Streetside, we are committed to enhancing the shopping experience for both customers and businesses. By offering an intuitive mobile application available for Android and iOS devices, customers can effortlessly make purchases at any time and from anywhere. Our goal is to meet customers where they are and provide a hassle-free shopping experience that saves time and effort.</p>\r\n\r\n<p>Join the Streetside community today and experience the convenience of online shopping, reliable delivery, and the satisfaction of supporting local businesses. Together, let&#39;s redefine how we shop, live, and thrive in Belize.</p>\r\n\r\n<p><strong>Commitment to Quality</strong></p>\r\n\r\n<p>At Streetside, we are committed to delivering the highest quality of service to our customers and businesses. We strive to ensure that every order is handled with the utmost care, from the moment it is placed to its timely delivery. We work closely with our partner stores to maintain high standards in food preparation, packaging, and overall product quality. Our dedicated team continuously monitors and evaluates the performance of our delivery drivers, ensuring professionalism and efficiency. We value feedback from our customers and actively use it to enhance our services, guaranteeing an exceptional experience with every order.</p>\r\n\r\n<p><strong>Social Responsibility</strong></p>\r\n\r\n<p>At Streetside, we believe in giving back to the community we serve. We actively engage in initiatives that contribute to the betterment of society and the environment. As part of our commitment to social responsibility, we focus on reducing our carbon footprint by optimizing delivery routes and promoting eco-friendly practices. We prioritize partnerships with local businesses, supporting the growth of the local economy and fostering a sense of community. Additionally, we explore opportunities to collaborate with charitable organizations and make a positive impact on causes that align with our values. Together, we can create a sustainable and inclusive future for all.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>',NULL,'2023-05-29 23:35:46'),(26,'privacy_policy','<h1><strong>Privacy Policy</strong></h1>\r\n\r\n<p>Last updated: December 14th, 2021</p>\r\n\r\n<p>At Streetside, your privacy is important to us. In this Privacy Policy, we tell you what information we collect, share with others, and how we use it.</p>\r\n\r\n<h3><strong>Scope of this Privacy Policy</strong></h3>\r\n\r\n<p>Streetside (&ldquo;Streetside,&rdquo; &ldquo;we,&rdquo; &ldquo;our,&rdquo; and/or &ldquo;us&rdquo;) values the privacy of individuals who use our website and mobile apps (collectively, our &ldquo;Platform&rdquo;). This privacy policy (the &ldquo;Privacy Policy&rdquo;) explains how we collect, use, and share information from Streetside&rsquo;s users (&ldquo;Users&rdquo;). It applies to our customers (&ldquo;Customers&rdquo;), individuals who deliver products requested by Customers through our Platform (&ldquo;Runners&rdquo;), anyone who signs up to become a Runner (&ldquo;Prospective Runners&rdquo;), businesses selling products through our Platform (&ldquo;Merchants&rdquo;), and other partners and/or end-users who use our Platform to facilitate delivery and/or sale of products (&ldquo;Partners&rdquo;). By using the Platform, you agree to the Privacy Policy and any future amendments and additions. Your use of our Platform is also subject to our Terms of Service.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>1. Information Streetside Collects From Users</strong></h3>\r\n\r\n<p>Streetside collects information from its Users. The categories of information we collect are described below in this Section 1.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>A. Information You Provide Directly to Us</strong></p>\r\n\r\n<p><strong>Customers</strong></p>\r\n\r\n<p><em>Sign Up and Profile Information</em>. When you sign up and/or place an order through Streetside as a Customer, you provide us with information, including, but not limited to your name, email address, physical address, and phone number. If you sign up using your Facebook account, we receive information including your name and email address. After registration, Customers can add multiple delivery addresses to their profile. You may be required to provide us with a photograph.</p>\r\n\r\n<p><em>Order Information</em>. When you place an order, we collect information related to the order, which may include items purchased, special instructions, date and time of order, and subtotal.</p>\r\n\r\n<p><em>Feedback</em>. We may ask you for feedback on your order, which may include a rating of experience, the applicable Merchant, and/or the applicable Runner. A review option is presented after each order&nbsp;</p>\r\n\r\n<p><em>Surveys</em>. We may offer an opportunity to participate in surveys, promotions, or contests. When a user participates, we may request certain information which may include name and email address.</p>\r\n\r\n<p><em>Payment Information</em>. When you add a payment card to your Streetside account, a third-party payments service provider receives your card information. We do not store full payment card information on our servers.</p>\r\n\r\n<p><strong>Active and Prospective Runners</strong></p>\r\n\r\n<p><em>Sign Up and Profile Information</em>. When you sign up to become a Runner, you may provide us with certain information, including, but not limited to your legal name, date of birth, email address, physical address, phone number, photo, vehicle information, and car insurance information. We share this information with third-party providers who initiate background check reports on you. Additional information about the third parties who run the background checks is provided in Section C below. We may also collect information from you after sign-up as is necessary to effectively operate the Platform.</p>\r\n\r\n<p><em>Surveys</em>. We may offer an opportunity to participate in surveys, promotions, or contests. When a user participates, we may request certain information which may include name and email address.</p>\r\n\r\n<p><em>Payment Information</em>. We receive information from Runners to provide payment and for tax reporting purposes, including but not limited to bank account and tax information.</p>\r\n\r\n<p><strong>Merchants and Partners</strong></p>\r\n\r\n<p><em>Profile Information</em>. A Merchant who signs up for our Platform or a Partner who utilizes our Platform provides us with certain information, including, but not limited to contact name, phone number, email address, physical address, hours, and product information, including product details and price.</p>\r\n\r\n<p><em>Payment Information</em>. We may receive Merchants&rsquo; bank account information to provide payment as well as any other information necessary to set up payment.</p>\r\n\r\n<p><strong>All Users</strong></p>\r\n\r\n<p><em>Communications</em>. If you contact us directly, we may collect additional information about you. For example, when you contact our Customer Support team or text with us and our Runners, we will receive and may retain your name, email address, and the contents of any message or attachments that you may send to us, as well as any other information you choose to provide.</p>\r\n\r\n<p><em>Feedback</em>. Customers and Runners may be able to rate and review each other at the end of every delivery. Customers may be able to see a Runner&rsquo;s aggregate ratings during a delivery. After delivery, we may share feedback or comments that Customers provide with Runners and/or Merchants, but we will not identify the Customer. If you are a Customer and do not want a Runner to know you provided certain feedback or comments, please do not include identifying information in that feedback or those comments. We may also share with Runners their aggregate ratings. Customers may also provide us information and feedback related to your experience on the Platform, including, but not limited to order reviews, merchant reviews, and merchant ratings.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>B. Information We Collect Automatically Through Your Use of the Platform</strong></p>\r\n\r\n<p><em>Location and Sensor Information</em>. We receive a Customer&rsquo;s location information when you&rsquo;re using the Streetside app, including when the app is in use in the foreground or background. We may continuously collect location information and other motion-generated or orientation-generated mobile sensor data from Runners and Prospective Runners when the Streetside app is in use in the foreground or background to personalize the app experience, assist in finding available markets and/or available delivery opportunities, offer delivery incentives, track the progress and completion of deliveries, and other similar purposes. We also use this information for analytics purposes. For information on your choices for sharing location information, please consult Section 6 on Your Choices.</p>\r\n\r\n<p><em>Device Information</em>. We receive information from Users&rsquo; devices, including IP address, web browser type, mobile operating system version, phone carrier and manufacturer, unique device identifiers, other information such as your device type, and if you register with your Facebook account, your Facebook identifier.</p>\r\n\r\n<p><em>Usage Information</em>. We automatically receive information about your interactions with our Platform, such as the pages you were visiting before accessing the Site or mobile application, or other content you view, the products you search for or purchase, and the dates and times of your visits, to help us understand how you use our Platform, help us improve our Platform, and provide you information about our Platform, Merchants, and Partners.</p>\r\n\r\n<p><em>Call and Text Information</em>. We work with one or more third parties to facilitate phone calls and text messages between Customers and Runners who are delivering the Customers&rsquo; products. We receive information about these communications including the date and time of the call or text message, the party&rsquo;s phone numbers, and the content of the text messages. By using Streetside services, including communicating with Streetside and your Runner, you consent to the receipt, recording, and monitoring by Streetside of text messages between you and Runners for quality assurance, customer service, security, and fraud prevention. We do not record or have access to the content of the phone calls between Customers and Runners. We do record and/or have access to the content of phone calls between Users and Streetside Merchants or Runners.</p>\r\n\r\n<p><em>Information from Cookies and Similar Technologies</em>. We and our service providers collect information through the use of &ldquo;cookies&rdquo; and similar technologies to understand how you navigate through and interact with our Platform, to learn what content is popular, for authentication and advertising purposes, and to save your preferences. Cookies are small text files that web servers place on your device; they are designed to store basic information and to help websites and apps recognize your browser. We may use both session cookies and persistent cookies. A session cookie disappears after you close your browser. A persistent cookie remains after you close your browser and may be accessed every time you use our Platform.&nbsp;</p>\r\n\r\n<p><em>Referrals</em>. You may be able to refer Streetside to friends and other contacts. To help you do this, we may request that you can grant us access to your mobile device address book. You can then direct us to send referral text messages or referral emails to contacts you select in your address book. We will use the data from your address book only to process your referral. By sending a referral, you also consent to Streetside sending your public profile image to the contacts you select to receive a referral link. By choosing to invite a friend you represent that you have received the friend&rsquo;s consent to provide his or her name and email address with Streetside. Streetside will use that information to send an email inviting him or her to visit the Platform and will store that information to track the success of the referral program. Streetside may also send marketing emails.</p>\r\n\r\n<p>Streetside users may not send, publish, or share any false, misleading, or deceptive communications in connection with participation in the referral program. These actions may violate various federal state and/or international laws, including, but not limited to, the regulations and policies of the Federal Trade Commission. In addition, Streetside users may not send any referral emails, text messages, or other communications to children under the age of 13.</p>\r\n\r\n<p>If you are referred to Streetside through one of our referral programs, or if someone attempts to refer you, Streetside may share your name, whether you already signed up for Streetside, whether you are a new customer, and whether you have placed a qualifying order with the person(s) who referred you.</p>\r\n\r\n<p><strong>C. Personal Information from Publicly-Available Sources and Third Parties</strong></p>\r\n\r\n<p><em>Information We Receive From Partners</em>. If you purchase through one of our Partners that offers delivery with Streetside, we receive information about your purchase, including your name, phone number, the product you purchased, and the delivery location.</p>\r\n\r\n<p><em>Background Information on Runners</em>. Streetside works with third-party providers to perform driving records and criminal background checks on Prospective Runners and active Runners, and in some instances, these third parties provide Prospective Runners&rsquo; and active Runners&rsquo; records to Streetside as part of the background check process.</p>\r\n\r\n<p><em>Information From Affiliates and Non-Affiliated Third Parties.</em>&nbsp;We may collect information about you or others through Streetside affiliates or non-affiliated third parties. For example, you may be able to access the Platform through a social networking account, such as Facebook. If you access the Platform through your Facebook account, you may allow us to have access to certain information in your Facebook profile. This may include your name, profile picture, gender, networks, and/or email address and other information you allow to be imported from Facebook, which is controlled in your Facebook privacy settings.</p>\r\n\r\n<p>Social networking sites, such as Facebook, have their policies for handling your information. For a description of how these sites may use and disclose your information, including any information you make public, please consult the sites&rsquo; privacy policies. We have no control over how any third-party site uses or discloses the personal information it collects about you.</p>\r\n\r\n<p>We may also collect information about you or others through non-affiliated third parties. For example, to the extent permitted by law, we may, in our sole discretion, ask for and collect supplemental information from third parties, such as information about your credit from a credit bureau, or information to verify your identity or trustworthiness, or for other fraud or safety protection purposes. We may also collect demographic information, which may include information such as income, marital status, spending habits, and other information about customers. We may combine information that we collect from you through the Platform with information that we obtain from such affiliated and non-affiliated third parties and information derived from any other products or services we provide.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>2. How We Use The Information We Collect From Users</strong></h3>\r\n\r\n<p>We use the information collected from and about Users for the following business and commercial purposes:</p>\r\n\r\n<ol>\r\n	<li>Provide services and features. Streetside uses the data we collect to provide, personalize, improve, expand, and promote our Platform and other services. This includes using data to:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Facilitate transactions, deliveries, and payments.</li>\r\n	<li>Analyze how you use our Platform.</li>\r\n	<li>Track and share progress of deliveries and orders.</li>\r\n	<li>Notify you about the progress of deliveries and orders.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>Communications. Streetside uses the data we collect to communicate with you, either directly or through one of our service providers, including for marketing and promotional purposes, and to respond to any issues that may arise during deliveries.</li>\r\n</ol>\r\n\r\n<p>Streetside also uses the data we collect to provide customer support, including but not limited to responding to customer support questions or your requests, and investigating and addressing User concerns.</p>\r\n\r\n<ol>\r\n	<li>Conduct research and development. Streetside may use the data we collect for testing, analysis, product development, and machine learning to improve a user&rsquo;s experience on the Platform.</li>\r\n	<li>Security and safety. We use the information we collect to help maintain the safety, security, and integrity of our services, third parties, and Users. This includes using data to:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Find and prevent fraud.</li>\r\n	<li>Protect Users and the Streetside business.</li>\r\n	<li>Provide account and network security.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>Maintain legal and regulatory compliance. Streetside may use the information we collect to maintain legal and regulatory compliance. This includes using data to:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Resolve disputes, to enforce any legal terms that govern your use of the Platform.</li>\r\n	<li>Pay our taxes or fulfill our business obligations.</li>\r\n	<li>Respond to requests by regulators, government entities, and official inquiries.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>Streetside business purposes. We may aggregate and/or de-identify information collected through the Platform. We may use de-identified or aggregated data for any purpose, including without limitation for research and marketing purposes, and may also share such data with any third parties, including without limitation, advertisers, promotional partners, sponsors, event promoters, and/or others.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>3. How Streetside Shares Information It Collects From Users</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>A. Sharing between Customers and Runners</strong></p>\r\n\r\n<p>To facilitate the delivery of orders, Runners and Customers may have access to certain information about each other. When Runners are offered delivery opportunities, they may be able to see the Customer&rsquo;s delivery location. Once a Runner accepts a delivery request from a Customer, the Customer may see the Runner&rsquo;s first name and last initial, photo, the aggregate rating, real-time location (which may reveal locations of other Customers to whom a Runner is providing a delivery), and/or other information to identify the Runner, including, but not limited to the Runner&rsquo;s license plate, and color, make, and model of vehicle. Runners may see the Customer&rsquo;s first name and last initial, and the Customer&rsquo;s delivery address and/or real-time location. Streetside allows Customers and Runners to call and text each other. Customer and Runner phone numbers are masked and, only in rare instances, may they be able to see the other&rsquo;s phone number. As described above, Customers can see a Runner&rsquo;s aggregate ratings during a delivery. After delivery, we may share feedback or comments that a Customer provides with a Runner, but we will not identify the Customer. If you are a Customer and do not want a Runner to know you provided certain feedback or comments, please do not include identifying information in that feedback or those comments. We may also share with Runners their aggregate ratings.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>B. Sharing between Runners and Merchants</strong></p>\r\n\r\n<p>Before a Runner picks up the delivery from the Merchant and/or Partner and during the delivery, the Merchant and/or Partners may be able to see the Runner&rsquo;s name, real-time location, and may be able to communicate directly with the Runner.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>C. Sharing between Customers and Merchants</strong></p>\r\n\r\n<p>We may share certain transactional details with Merchants from whom you&rsquo;ve placed orders, such as your name, phone number, email address, and/or any physical address associated with your account or any delivery, with the Merchants from whom you&rsquo;ve placed orders. Merchants may also have access to your public profile image, your feedback, and/or order information, including your purchase history and other information related to your orders with the particular Merchant. Such information provided to Merchants is not subject to this Privacy Policy but instead is subject to Merchant&rsquo;s privacy policies which may allow Merchant to, among other things, send you marketing communications and other promotional content.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>D. Service Providers</strong></p>\r\n\r\n<p>We share your information with service providers that perform services on our behalf, including all of the uses described in this Section 3. Some examples of service providers are third parties we use for payment processing, advertising, marketing, and analytics.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>E. Other Sharing</strong></p>\r\n\r\n<p>We may share your information with third parties in the following cases:</p>\r\n\r\n<ul>\r\n	<li>Where disclosure is required or appropriate to comply with laws, regulations, legal process, or an agency or governmental request;</li>\r\n	<li>With law enforcement officials, government authorities, or third parties, if we think doing so is necessary to protect the rights, property, or safety of Streetside, our Users, or the public;</li>\r\n	<li>To protect the security or integrity of our Platform;</li>\r\n	<li>To enforce our agreements, policies, and Terms of Service;</li>\r\n	<li>To respond to an emergency which we believe in good faith requires us to disclose information to assist in preventing the death or serious bodily injury of any person;</li>\r\n	<li>To investigate and defend ourselves or others against any third-party claims or allegations;</li>\r\n	<li>To provide information about the use of our Platform to Runners, Merchants, Partners, or potential business partners in an aggregated or de-identified form that cannot reasonably be used to identify you;</li>\r\n	<li>While negotiating or about a business transaction, such as a merger, sale of assets, or bankruptcy;</li>\r\n	<li>Whenever you consent to the sharing, including without limitation when you use the social features of the Platform to (1) review, rate, and/or provide feedback on Merchants that will be available for viewing by other Users; (2) share the orders you&rsquo;ve placed through the Platform with other Users, including, but not limited to designated favorite orders; and/or (3) share your favorite items/Merchants or lists of items/Merchants with other Users; and</li>\r\n	<li>When you share certain information related to orders with other Users or non-Users, including, but not limited to (a) your cart; (b) the fees associated with your Order (e.g. to split payment with others); (c) the estimated time of delivery and progress of your Order; and/or (d) order destination.</li>\r\n</ul>\r\n\r\n<h3><strong>4. Online Analytics &amp; Interest-Based Advertising</strong></h3>\r\n\r\n<p>We or third parties may place cookies, web beacons, or other tracking technologies on your computer, mobile phone, or other devices to collect information about your use of the Platform. Cookies are small bits of data we store on the device (computer, mobile phone, tablet, or any other mobile device) that you use to access the Platform. We use cookies and other tracking technologies to (a) inform, optimize, and serve marketing content based on past visits to our websites and other sites, (b) report how our marketing content impressions, other uses of marketing services, and interactions with these marketing impressions and marketing services are related to visits to our websites, (c) help us understand how the Platform is being used, (d) let you navigate between pages efficiently, (d) remember your preferences, and (e) generally improve your browsing experience. We also allow other third parties (e.g., ad networks and ad servers such as Google Analytics, DoubleClick, and others) to serve tailored marketing to you and to access their cookies or other tracking technologies on your computer, mobile phone, or other devices you use to access the Platform. We neither have access to, nor does this Privacy Policy govern, the use of cookies or other tracking technologies that may be placed on your computer, mobile phone, or other devices you use to access the Platform by non-affiliated, third-party ad technology, ad servers, ad networks or any other non-affiliated third parties. Those parties that use these technologies may offer you a way to opt-out of targeted advertising as described below. You may receive tailored advertising on your computer through a web browser. Cookies may be associated with de-identified data linked to or derived from data you voluntarily have submitted to us (e.g., your email address) that we may share with a service provider in hashed, non-human-readable form.</p>\r\n\r\n<p>We and our third-party vendors may use Device IDs and other automated technologies (including cookie identifiers on our website), along with other collected information, to deliver content or tailor ads when you are on our Platform or other devices, apps, or websites. These ads may be based, for instance, on the types of websites that you visit over time, the types of apps you have on your device, or de-identified information about you and your likely interests, based on your activities off of our Platform. This type of advertising is often called &ldquo;interest-based&rdquo; or &ldquo;personalized&rdquo; advertising&mdash;and when it occurs on mobile apps, &ldquo;cross-app&rdquo; advertising.</p>\r\n\r\n<p>Partners that we or others work with to do the above may track your activities over time (including across different apps or websites) by collecting information through automated means, and they may use this information, and other information they receive from us or other sources, to deliver advertisements to you. If you are interested in more information about tailored browser advertising and how you can generally control cookies from being put on your computer to deliver tailored marketing, you may visit the<a href=\"http://www.networkadvertising.org/choices\" target=\"_blank\">&nbsp;Network Advertising Initiative&rsquo;s Consumer Opt-Out Link</a>&nbsp;and/or the<a href=\"http://www.aboutads.info/choices\" target=\"_blank\">&nbsp;Digital Advertising Alliance&rsquo;s Consumer Opt-Out Link</a>&nbsp;to opt-out of receiving tailored advertising from companies that participate in those programs. To opt-out of Google Analytics for Display Advertising or customize Google Display Network ads, you can visit the<a href=\"https://www.google.com/settings/ads\" target=\"_blank\">&nbsp;Google Ads Settings page</a>. You can also opt-out of cross-app advertising by following the instructions for your operating system, (iOS for Apple phones, Android for Android devices, and Windows for Microsoft devices). Please note that to the extent advertising technology is integrated into the Platform, you may still receive advertising content even if you opt-out of tailored advertising. In that case, the advertising content will just not be tailored to your interests. Also, we do not control any of the above opt-out links and are not responsible for any choices you make using these mechanisms or the continued availability or accuracy of these mechanisms. If your browsers are configured to reject cookies when you visit this opt-out page, or you subsequently erase your cookies, use a different computer or change web browsers, your NAI or DAA opt-out may no longer be effective. Additional information is available on NAI&rsquo;s and DAA&rsquo;s websites, accessible by the above links.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>5. Social Media Usage</strong></h3>\r\n\r\n<p>You may choose to enable or log in to our Platform via various online services, including social networking services like Facebook and Google(not released to writing). Our Services also may enable you to access social networking services such as Facebook, Twitter, Instagram, or Snapchat (collectively, &ldquo;Social Network&rdquo;) directly or indirectly through our Platform.</p>\r\n\r\n<p>When you link a Social Network account to Streetside or log into our Platform using your Social Network account, we may collect relevant Personal Information necessary to enable our Platform to access that Social Network and your data contained within that Social Network. We also may share your information with the operator of that Social Network to facilitate or enhance the delivery of that Social Network or other services to you. A Social Network may provide us with access to certain information that you have provided to them, and we will use, store, and disclose such information under this Privacy Policy. Additionally, a Social Network may collect information, including information about your use of our Platform automatically. How a Social Network collects, uses, stores, and discloses your information is governed by the policies of such third parties and Streetside shall have no liability or responsibility for the privacy practices or other actions of any Social Network that may be enabled within our Platform.</p>\r\n\r\n<p>You may also have the option of posting your activities on our Platform and other content to a Social Network when you access content through our Platform. For example, you may post to Facebook that you placed an order with Streetside. Keep in mind that your usage of Social Network features is governed by applicable Social Networks and not by Streetside, and may be visible or accessible to the public.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>6. Your Choices</strong></h3>\r\n\r\n<p>In addition to other choices described in this Privacy Policy and the Platform, you have other choices regarding your information:</p>\r\n\r\n<p>Location Information. While you can prevent your device from sharing location information at any time through your device&rsquo;s operating system settings, Customer and Runner location is core to our Platform and without it, you may not be able to successfully use our Platform.</p>\r\n\r\n<p>Email Subscriptions. You can always unsubscribe from our promotional emails via the link provided in the emails. Even if you opt-out from receiving promotional messages from us, you will continue to receive administrative messages from us.</p>\r\n\r\n<p>Account Deletion. If you would like to delete your Streetside account, please contact us through our Help Center with your request. If you choose to delete your account, we will delete it for you, but may retain certain information to collect any fees owed, resolve disputes, troubleshoot problems, analyze usage of the Platform, assist with any investigations, prevent fraud, enforce our Terms of Service, or take other actions as required or permitted by law and/or regulations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>7. Third-Party Links</strong></h3>\r\n\r\n<p>Our Platform may contain links to other websites, products, or services that we do not have control over. Please be aware that we are not responsible for the privacy practices of such third parties. We encourage you to read their privacy policies before giving them your information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>8. Data Security</strong></h3>\r\n\r\n<p>We are committed to protecting your information. We use administrative, logical, physical, and managerial measures to safeguard your personal information against loss, theft, and unauthorized access, use, and modification. Unfortunately, no security measures can be 100% secure, so we cannot guarantee the security of Users&rsquo; data. While we do our best to protect your information, you are also responsible for protecting your information by, for example, protecting your account credentials. If you have any reason to believe that your account has been compromised, please notify us immediately through our Help Center.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>9. Children&rsquo;s Privacy</strong></h3>\r\n\r\n<p>Streetside is not directed to children, and we do not knowingly collect personal information from children under 13. If you believe that a child under the age of 13 has given us personal information, please contact us via our Help Center.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>10. Consent to Transfer</strong></h3>\r\n\r\n<p>Our computer systems are currently based in Belize, so your data will be processed by us in Belize, where data protection and privacy regulations may not offer the same level of protection as in other parts of the world. If you create an account with the Platform as a visitor from outside Belize, by using the Platform, you agree to this Privacy Policy and you consent to the transfer of all such information to Belize, which may not offer a level of protection equivalent to that required in certain other countries, and to the processing of that information as described in this Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>11. Other Important Information</strong></h3>\r\n\r\n<p>Parts of the Platform may include third-party integrations such as Google Maps features and content, including the Google Maps API(s). Your use of these services is subject to their respective privacy policies such as the Google Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>12. Changes to Our Privacy Policy</strong></h3>\r\n\r\n<p>We may make changes to this Privacy Policy from time to time. If we make any changes, we will revise the &ldquo;Last Updated&rdquo; date at the top of this Privacy Policy. If we make any material changes, we will let you know through the Platform, by email, or other communication. We encourage Users to read this Privacy Policy periodically to stay up-to-date about our privacy practices. As long as you use the Platform, you are agreeing to this Privacy Policy and any updates we make to it.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>13. Contact Information</strong></h3>\r\n\r\n<p>Feel free to contact us at any time with any questions or comments about this Privacy Policy, your personal information, our use and sharing practices, or your choices regarding your information by contacting us at our Help Center.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>14. User Deletion</strong></h3>\r\n\r\n<p>To delete your data from the Streetside Platform you would need to contact the support team(support@streetsideco.com). You would need to provide your name and email address/addresses that you were using on the platform along with a reason why you want this data deleted.&nbsp;</p>\r\n\r\n<p>A simple template would be something like:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Hey, Streetside Support,&nbsp;</p>\r\n\r\n<p>I would love to have my data removed from your platform please, I already uninstalled the app and would not like you to have or use my data. My name is Jane Mastermind and my email is&nbsp;janemastermind@gmail.com. Thanks for understanding.&nbsp;</p>\r\n\r\n<p>Regards,&rdquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Then we would proceed to add our information to the message versus that of Jane, and the Support team would delete your information and confirm after it has been deleted.&nbsp;</p>',NULL,'2023-05-29 23:47:23'),(27,'minimum_shipping_charge','2',NULL,NULL),(28,'per_km_shipping_charge','1',NULL,NULL),(29,'digital_payment','{\"status\":\"1\"}','2021-07-01 14:27:38','2023-08-30 21:55:56'),(30,'ssl_commerz_payment','{\"status\":\"0\",\"store_id\":null,\"store_password\":null}','2021-07-04 15:41:24','2022-03-23 04:21:28'),(31,'razor_pay','{\"status\":\"0\",\"razor_key\":null,\"razor_secret\":null}','2021-07-04 15:41:28','2022-03-23 04:21:38'),(32,'paypal','{\"status\":\"0\",\"paypal_client_id\":null,\"paypal_secret\":null}','2021-07-04 15:41:34','2022-03-23 04:21:49'),(33,'paystack','{\"status\":\"0\",\"publicKey\":null,\"secretKey\":null,\"paymentUrl\":null,\"merchantEmail\":null}','2021-07-04 15:41:42','2022-03-23 04:22:15'),(34,'senang_pay','{\"status\":null,\"secret_key\":null,\"published_key\":null,\"merchant_id\":null}','2021-07-04 15:41:48','2023-06-01 22:15:41'),(35,'order_handover_message','{\"status\":1,\"message\":\"Delivery man is on the way\"}',NULL,NULL),(36,'order_cancled_message','{\"status\":1,\"message\":\"Order is canceled by your request\"}',NULL,NULL),(37,'timezone','US/Central',NULL,NULL),(38,'order_delivery_verification',NULL,NULL,NULL),(39,'currency_symbol_position','left',NULL,NULL),(40,'schedule_order','1',NULL,NULL),(41,'app_minimum_version','0',NULL,NULL),(42,'tax',NULL,NULL,NULL),(43,'admin_commission','10',NULL,NULL),(44,'country','BZ',NULL,NULL),(45,'app_url','https://www.google.com',NULL,NULL),(46,'default_location','{\"lat\":\"17.15953071218628\",\"lng\":\"-89.07970375043789\"}',NULL,NULL),(47,'twilio_sms','{\"status\":0,\"sid\":null,\"token\":null,\"from\":null,\"otp_template\":\"Your otp is #OTP#.