 to finalizing the cancellation, you will be clearly informed of any applicable charges. These charges may encompass non-refundable fees, processing fees, or expenses associated with preparing or shipping the order.<\\/p>\\r\\n\\r\\n<p>3. Notification of Charges:<br \\/>\\r\\n&nbsp; &nbsp;a. In order to provide transparency and enable an informed decision-making process, we will notify you of any applicable charges before you complete the cancellation. This will allow you to understand the financial implications and decide whether to proceed with the cancellation or retain the order.<br \\/>\\r\\n&nbsp; &nbsp;b. You will receive a notification of charges during the cancellation process, typically through our app or website. Additionally, we may communicate this information via email or other suitable channels.<\\/p>\\r\\n\\r\\n<p>4. Refund Process:<br \\/>\\r\\n&nbsp; &nbsp;a. If your cancellation qualifies for a refund, the appropriate refund amount will be processed in accordance with our refund policy. Generally, refunds are issued using the original payment method utilized during the purchase.<br \\/>\\r\\n&nbsp; &nbsp;b. Please note that the refund process may require some time, and additional terms and conditions outlined in our refund policy may apply.<\\/p>\\r\\n\\r\\n<p>5. Contacting Customer Support:<br \\/>\\r\\n&nbsp; &nbsp;a. Should you have any inquiries or concerns regarding the cancellation process, charges, or refunds, our dedicated customer support team is ready to assist you. You can reach out to our support team by emailing support@streetsideco.com, and we will promptly address your questions.<\\/p>\\r\\n\\r\\n<p>At Streetside, we value your trust and aim to provide a seamless experience throughout the ordering process, including cancellations. By familiarizing yourself with our cancellation policy, you can make informed decisions and gain clarity regarding potential charges associated with canceling an order. Should you require further information or have additional questions, please refer to our full Cancellation Policy or contact our customer support team.<\\/p>\"}',NULL,'2023-05-30 00:01:55'),(123,'shipping_policy','{\"status\":\"1\",\"value\":\"<p>Shipping Policy:<\\/p>\\r\\n\\r\\n<p>At Streetside, we are dedicated to providing convenient and efficient on-demand delivery services for your orders. Our Shipping Policy outlines important information regarding the shipment and delivery of orders placed through Streetside Stores. Please review the following details:<\\/p>\\r\\n\\r\\n<p>1. On-Demand Delivery:<br \\/>\\r\\n&nbsp; &nbsp;a. We offer on-demand delivery services, which means that your order will be dispatched as soon as it is ready for delivery. Our goal is to provide timely and convenient delivery options to meet your needs.<br \\/>\\r\\n&nbsp; &nbsp;b. With our on-demand delivery service, you can expect prompt and efficient delivery of your orders to your designated delivery address.<\\/p>\\r\\n\\r\\n<p>2. Delivery Areas:<br \\/>\\r\\n&nbsp; &nbsp;a. Currently, our on-demand delivery services are available within specified delivery areas\\/zones across Belize. These areas are determined based on the coverage provided by our delivery partners.<br \\/>\\r\\n&nbsp; &nbsp;b. During the checkout process, please ensure that your delivery address falls within our serviceable area to confirm eligibility for on-demand delivery.<\\/p>\\r\\n\\r\\n<p>3. Delivery Timeframes:<br \\/>\\r\\n&nbsp; &nbsp;a. We strive to deliver your orders as quickly as possible. The estimated delivery timeframe will be provided during the checkout process, and it may vary based on factors such as the availability of the product, seller location, and distance to your delivery address.<br \\/>\\r\\n&nbsp; &nbsp;b. We understand the importance of timely delivery and make every effort to ensure that your orders are delivered within the estimated timeframe. However, please note that unforeseen circumstances or external factors beyond our control may occasionally cause delays. We appreciate your understanding in such situations.<\\/p>\\r\\n\\r\\n<p>4. Order Tracking:<br \\/>\\r\\n&nbsp; &nbsp;a. To keep you informed about the progress of your on-demand delivery, we provide order-tracking capabilities. Once your order has been confirmed and dispatched, you will receive a tracking number and instructions on how to track your shipment.<br \\/>\\r\\n&nbsp; &nbsp;b. You can access the tracking information through our mobile applications (Android and iOS Apps) or by visiting our website. Tracking allows you to stay updated on the status of your shipment, including real-time location updates and estimated delivery time.<\\/p>\\r\\n\\r\\n<p>5. Delivery Partners:<br \\/>\\r\\n&nbsp; &nbsp;a. We work with trusted and reliable delivery partners to ensure the efficient and secure delivery of your orders. These partners are selected based on their expertise in on-demand delivery services and their commitment to customer satisfaction.<br \\/>\\r\\n&nbsp; &nbsp;b. Our delivery partners are responsible for handling and transporting your orders with care, ensuring that they arrive at your designated delivery address in excellent condition and within the agreed timeframe.<\\/p>\\r\\n\\r\\n<p>6. Delivery Charges:<br \\/>\\r\\n&nbsp; &nbsp;a. Delivery charges may apply to your order, and these charges will be clearly communicated during the checkout process. The exact amount will depend on factors such as the delivery distance, order value, and any applicable promotions or discounts.<br \\/>\\r\\n&nbsp; &nbsp;b. In some cases, free or discounted delivery may be available based on promotional offers or specific terms and conditions. Please refer to the applicable offer details to determine eligibility for such benefits.<\\/p>\\r\\n\\r\\n<p>7. Address Accuracy:<br \\/>\\r\\n&nbsp; &nbsp;a. It is crucial to provide accurate and complete delivery address details during the ordering process. Please ensure that all address information, including the building number, street name, and any additional instructions or landmarks, is entered correctly.<br \\/>\\r\\n&nbsp; &nbsp;b. We cannot be held responsible for delays or undeliverable shipments resulting from inaccurate or incomplete address information provided by the customer.<\\/p>\\r\\n\\r\\n<p>8. Failed Delivery Attempts:<br \\/>\\r\\n&nbsp; &nbsp;a. Our delivery partners will make reasonable attempts to deliver your order to the provided delivery address. In the event of a failed delivery attempt, they may try again on subsequent days or contact you for further instructions.<br \\/>\\r\\n&nbsp; &nbsp;b. If repeated delivery attempts are unsuccessful, our customer support team will reach out to you to discuss the situation and explore alternative delivery options, such as order pickup or rescheduling.<\\/p>\\r\\n\\r\\n<p>If you have any further questions or require assistance regarding our shipping policy or the on-demand delivery of your order, please contact our customer support team at support@streetsideco.com. We are committed to providing exceptional service and ensuring your satisfaction with our on-demand delivery process.<\\/p>\"}',NULL,'2023-05-30 00:01:46'),(124,'fcm_credentials','{\"apiKey\":\"AIzaSyDhpPwZOKxFJRB4BPRiYJ4AG_5qxWHiVms\",\"authDomain\":\"streetsideco.firebaseapp.com\",\"projectId\":\"streetsideco\",\"storageBucket\":\"streetsideco.appspot.com\",\"messagingSenderId\":\"296214775948\",\"appId\":\"1:296214775948:web:5f222a992f62357e3dd3a9\",\"measurementId\":\"G-42CDP4KXV7\"}',NULL,NULL),(125,'system_language','[{\"id\":1,\"direction\":\"ltr\",\"code\":\"en\",\"status\":1,\"default\":true},{\"id\":3,\"direction\":\"ltr\",\"code\":\"es\",\"status\":1,\"default\":false}]','2023-05-31 20:42:02','2023-08-23 21:15:40'),(126,'apple_login','[{\"login_medium\":\"apple\",\"client_id\":\"com.streetsideco.stores\",\"client_secret\":null,\"status\":\"1\",\"team_id\":\"6B4L7XHQPG\",\"key_id\":\"SGC5QA7H52\",\"service_fi