min_landing_page','2023-06-11 13:14:25','2023-08-17 22:12:22'),(16,'earning_title','Earn Money','admin_landing_page','2023-06-11 13:26:01','2023-06-11 13:26:01'),(17,'earning_sub_title','Earn money  by using different platform','admin_landing_page','2023-06-11 13:26:01','2023-06-11 13:26:01'),(18,'earning_seller_image','2023-06-11-648593813b6c1.png','admin_landing_page','2023-06-11 13:27:29','2023-06-11 13:27:29'),(19,'seller_app_earning_links','{\"playstore_url_status\":null,\"playstore_url\":null,\"apple_store_url_status\":null,\"apple_store_url\":null}','admin_landing_page',NULL,NULL),(20,'earning_delivery_image','2023-06-11-648593d069147.png','admin_landing_page','2023-06-11 13:28:48','2023-06-11 13:28:48'),(21,'dm_app_earning_links','{\"playstore_url_status\":null,\"playstore_url\":null,\"apple_store_url_status\":null,\"apple_store_url\":null}','admin_landing_page',NULL,NULL),(22,'why_choose_title','What so Special About 6amMart ?','admin_landing_page','2023-06-11 13:30:30','2023-06-11 13:32:08'),(23,'counter_section','{\"app_download_count_numbers\":\"300\",\"seller_count_numbers\":\"85\",\"deliveryman_count_numbers\":\"150\",\"customer_count_numbers\":\"10000\",\"status\":\"1\"}','admin_landing_page',NULL,NULL),(24,'download_user_app_title','Lets  Manage','admin_landing_page','2023-06-11 13:38:17','2023-06-11 13:38:17'),(25,'download_user_app_sub_title','Your business  Smartly or Earn.','admin_landing_page','2023-06-11 13:38:17','2023-06-11 13:38:17'),(26,'download_user_app_image','2023-06-11-648596096d79e.png','admin_landing_page','2023-06-11 13:38:17','2023-06-11 13:38:17'),(27,'download_user_app_links','{\"playstore_url_status\":\"1\",\"playstore_url\":\"https:\\/\\/play.google.com\\/store\\/apps\\/details?id=com.sixamtech.sixam_mart_store_app\",\"apple_store_url_status\":\"1\",\"apple_store_url\":\"https:\\/\\/www.apple.com\\/app-store\"}','admin_landing_page',NULL,NULL),(28,'testimonial_title','People Who Shared Love with us?','admin_landing_page','2023-06-11 13:42:04','2023-06-11 13:42:04'),(29,'contact_us_title','Contact Us','admin_landing_page','2023-06-11 13:53:22','2023-06-11 13:53:22'),(30,'contact_us_sub_title','Any question or remarks? Just write us a message!','admin_landing_page','2023-06-11 13:53:22','2023-06-11 13:53:22'),(31,'contact_us_image','2023-06-11-6485999308039.png','admin_landing_page','2023-06-11 13:53:23','2023-06-11 13:53:23'),(32,'refund_policy_status','1','admin_landing_page','2023-06-11 18:10:58','2023-06-11 18:10:58'),(33,'refund_policy','<p>**Refund Policy**</p>\r\n\r\n<p>At Streetside Stores, we are committed to providing you with the best possible service and customer experience. If you are not completely satisfied with your purchase, we offer a straightforward refund policy outlined below:</p>\r\n\r\n<p>**1. Order Cancellation Before Delivery:**<br />\r\nYou may cancel your order directly within the app before it has been dispatched for delivery. Once your order is out for delivery, cancellations will not be possible. To request an order cancellation, simply follow the cancellation process within the app.</p>\r\n\r\n<p>**2. Defective or Incorrect Items:**<br />\r\nIf you receive an item that is defective, damaged, or different from what you ordered, please contact us within 1 hour of receiving the item. Attach a clear photo of the item and its condition as proof. We will arrange for a replacement or issue a refund, depending on your preference and product availability.</p>\r\n\r\n<p>**3. Refund Eligibility and Process:**<br />\r\nTo be eligible for a refund, you must provide proof of purchase and the reason for the refund request. Refunds will be processed within 5 - 10 business days&nbsp;of receiving and inspecting the returned item. Refunds will be issued through the original payment method used for the purchase.</p>\r\n\r\n<p>**4. Non-Refundable Items:**<br />\r\nCertain items, such as perishable goods (e.g., food), personalized products, and digital goods, may not be eligible for a refund. Please check the product description and details before making a purchase.</p>\r\n\r\n<p>**5. Return Shipping:**<br />\r\nIf a return is required for eligible refund cases, you may be responsible for the cost of return shipping. We recommend using a trackable shipping service to ensure your returned items reach us safely.</p>\r\n\r\n<p>**6. Contact Us:**<br />\r\nIf you have any questions about our refund policy, or if you would like to initiate a refund request, please contact our customer support team at [customer support email or phone number].</p>\r\n\r\n<p>**7. Changes to Refund Policy:**<br />\r\nStreetside Stores reserves the right to modify or update this refund policy at any time. Changes to the policy will be posted on our website and within the app. It is your responsibility to review the policy periodically for any updates.</p>\r\n\r\n<p>---</p>','admin_landing_page','2023-06-11 18:10:59','2023-08-22 19:11:32'),(34,'header_title','$Your e-Commerce!$','react_landing_page','2023-06-12 14:30:53','2023-06-12 17:41:19'),(35,'header_sub_title','Venture Starts Here','react_landing_page','2023-06-12 14:30:53','2023-06-12 15:55:14'),(36,'header_tag_line','More than just a reliable $eCommerce$ platform','react_landing_page','2023-06-12 14:30:53','2023-06-12 15:45:24'),(37,'header_icon','2023-06-12-648721d3028d4.png','react_landing_page','2023-06-12 14:30:53','2023-06-12 17:46:59'),(38,'header_banner','2023-06-12-648721d30552a.png','react_landing_page','2023-06-12 14:30:53','2023-06-12 17:46:59'),(39,'company_title','$6amMart$','react_landing_page','2023-06-12 14:35:07','2023-06-12 15:46:19'),(40,'company_sub_title','is Best Delivery Service Near You','react_landing_page','2023-06-12 14:35:07','2023-06-12 14:35:07'),(41,'company_description','6amMart is a one-stop shop for all your daily necessities. You can shop for groceries, and pharmacy items, order food, and send important parcels from one place to another from the comfort of your home.','react_lan