INSERT INTO `modules` VALUES (1,'Food','food','2023-11-14-655320b919f0f.png',1,3,'2023-05-31 22:12:44','2024-02-18 23:02:39','2023-06-01-64782908ee993.png',1,'<p>Experience the culinary delights of Belize with Streetside Stores, the premier food delivery service in the region. Whether you&#39;re craving traditional Belizean dishes, exotic international flavors, or classic comfort food, our extensive network of restaurants caters to every palate. We&#39;re committed to delivering your favorite meals swiftly and safely, ensuring a dining experience that&#39;s both convenient and enjoyable. With Streetside Stores, savor the best of Belize&#39;s vibrant food scene right from the comfort of your home.</p>',0),(2,'Parcel','parcel','2023-08-06-64d066776cb1d.png',1,0,'2023-08-06 20:35:19','2023-12-12 13:22:28','2023-08-06-64d06677644e4.png',1,'<p>Experience hassle-free parcel delivery with Streetside. Our user-friendly platform connects you to trusted couriers for secure and timely package transportation.</p>',0),(3,'Pharmacy','pharmacy','2023-11-14-65544f31eceac.png',1,0,'2023-11-14 10:40:33','2023-11-14 21:55:13','2023-11-14-65544f31ecaa7.png',1,'<p>With Streetside Stores, accessing healthcare products in Belize has never been easier. Our reliable pharmacy delivery service ensures that you receive your essential medications, health supplements, and wellness products swiftly and securely. We understand the importance of timely healthcare, which is why we&#39;re dedicated to providing a seamless and convenient delivery experience. Trust Streetside Stores for your pharmacy needs, and take the first step towards a healthier, stress-free life.</p>',0),(4,'Grocery','grocery','2023-11-14-65544fc5508e7.png',1,0,'2023-11-14 21:46:18','2023-11-14 21:57:41','2023-11-14-65544fc5504a7.png',1,'<p>Streetside Stores transforms grocery shopping in Belize, offering a convenient, hassle-free way to get all your daily essentials. Our platform connects you with a wide range of grocery items, from fresh fruits and vegetables to pantry staples and household necessities. Enjoy the ease of online shopping combined with fast, reliable delivery services, ensuring that your kitchen is always stocked with everything you need. Choose Streetside Stores for a seamless grocery shopping experience.</p>',0);
