INSERT INTO `parcel_categories` VALUES (1,'2023-08-09-64d443c096f2e.png','Item Pickup','Do you need your charger? Do you need to send a package to a friend?',1,0,2,'2023-08-09 18:56:16','2023-12-10 22:07:15',1.00,6.00),(2,'2023-12-10-6576964f4976f.png','Gifts','Perfect for birthdays, anniversaries, or special occasions. Our Gift Delivery service ensures your thoughtful presents are delivered with care and timeliness to surprise and delight your loved ones.',1,0,2,'2023-12-10 21:55:43','2023-12-10 21:55:43',1.00,6.00),(3,'2023-12-10-657696ca41cc0.png','Bank Runs','Need to get documents or parcels to and from a bank? Our Bank Run service is designed for secure and efficient banking-related deliveries, saving you time and hassle.',1,0,2,'2023-12-10 21:57:46','2023-12-10 21:57:46',1.00,8.00),(4,'2023-12-10-6576977656848.png','Tech and Electronics','Forgot your Charger? This is designed for gadgets, devices, and electronic components, offering secure and damage-proof transportation to safeguard your valuable tech items during transit.',1,0,2,'2023-12-10 22:00:38','2023-12-10 22:00:38',1.00,6.00),(5,'2023-12-10-657698faf2444.png','Food and Grocery Deliveries','This service caters to the delivery of fresh food and groceries, ensuring that your edibles are transported in optimal conditions and arrive ready to enjoy.',1,0,2,'2023-12-10 22:07:07','2023-12-10 22:07:07',1.00,6.00),(6,'2023-12-10-657699dd72ff1.png','E-Commerce Deliveries','Tailored for online businesses and shoppers. This category facilitates the reliable delivery of e-commerce goods, from small items to larger packages, directly to or from customers.',1,0,2,'2023-12-10 22:10:53','2023-12-10 22:10:53',1.00,6.00);
