appy to help.',NULL,NULL),(14,'App\\Models\\EmailTemplate',3,'en','copyright_text',' 2023 Streetsideco. All rights reserved.',NULL,NULL),(15,'App\\Models\\EmailTemplate',4,'en','title','New Withdraw Request',NULL,NULL),(16,'App\\Models\\EmailTemplate',4,'en','body','<p>Please find below the details of the new Withdraw Request:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Store Name: {storeName}</strong></p>\r\n\r\n<p>To review the Refund Request, go to:&nbsp;</p>\r\n\r\n<p><strong>Transactions &amp; Reports</strong><strong>&rarr;Withdraw Requests</strong></p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL),(17,'App\\Models\\EmailTemplate',4,'en','button_name','Review Request',NULL,NULL),(18,'App\\Models\\EmailTemplate',4,'en','footer_text','Please contact us for any queries; were always happy to help.',NULL,NULL),(19,'App\\Models\\EmailTemplate',4,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(20,'App\\Models\\EmailTemplate',5,'en','title','BUY ONE GET ONE Campaign Join Request',NULL,NULL),(21,'App\\Models\\EmailTemplate',5,'en','body','<p>Please find below the details of the new Campaign Join Request:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Store Name: {storeName}</strong></p>\r\n\r\n<p>To review the Refund Request, go to:&nbsp;</p>\r\n\r\n<p><strong>Module Section</strong><strong>&rarr;Choose Module&rarr;Promotion Management&rarr;Campaigns&rarr;Basic Campaigns&rarr;Buy One Get One</strong></p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL),(22,'App\\Models\\EmailTemplate',5,'en','button_name','Review Request',NULL,NULL),(23,'App\\Models\\EmailTemplate',5,'en','footer_text','Please contact us for any queries; were always happy to help.',NULL,NULL),(24,'App\\Models\\EmailTemplate',5,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(25,'App\\Models\\EmailTemplate',6,'en','title','You Have A Refund Request.',NULL,NULL),(26,'App\\Models\\EmailTemplate',6,'en','body','<p>Please find below the details of the new Refund Request:</p>\r\n\r\n<p><strong>Customer Name: {userName}</strong></p>\r\n\r\n<p><strong>Order ID: {orderId}</strong></p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL),(27,'App\\Models\\EmailTemplate',6,'en','button_name','Review Request',NULL,NULL),(28,'App\\Models\\EmailTemplate',6,'en','footer_text','Please contact us for any queries; were always happy to help.',NULL,NULL),(29,'App\\Models\\EmailTemplate',6,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(30,'App\\Models\\EmailTemplate',1,'en','title','Change Password Request',NULL,NULL),(31,'App\\Models\\EmailTemplate',1,'en','body','<p>The following user has forgotten his password &amp; requested to change/reset their password.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>User Name: {userName}</strong></p>',NULL,NULL),(32,'App\\Models\\EmailTemplate',1,'en','button_name','',NULL,NULL),(33,'App\\Models\\EmailTemplate',1,'en','footer_text','Please contact us for any queries; were always happy to help.',NULL,NULL),(34,'App\\Models\\EmailTemplate',1,'en','copyright_text',' 2023 Streeside. All rights reserved.',NULL,NULL),(35,'App\\Models\\EmailTemplate',8,'en','title','Your Registration is Submitted Successfully!',NULL,NULL),(36,'App\\Models\\EmailTemplate',8,'en','body','<p>Hey there,&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We are thrilled to welcome you to Streetside Stores, Belize&#39;s premier food delivery and service platform! Congratulations on joining our dynamic network of local businesses, where we connect you with countless customers seeking the best in their neighborhoods.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>At Streetside Stores, we are committed to helping businesses like yours thrive by providing a seamless and efficient platform to reach a broader audience. Whether you&#39;re a restaurant, bar, or retail store, we are excited to partner with you to elevate your services and offer convenience to our ever-growing user base.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Here&#39;s a quick guide to getting started with Streetside Stores:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. **Merchant App - Streetside Managers:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- You can manage all your operations on a larger display from our website. You can find that here: <a href=\"https://www.edmund@streetsideapp.com\">https://www.streetsideapp.com/store</a></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Log in using your registered credentials used during the sign-up process.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. **Manage Your Inventory:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Take advantage of the easy-to-use inventory management system. Keep your menu or product listings up-to-date, ensuring your customers have access to the latest offerings.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. **Receive and Process Orders:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Get real-time notifications whenever an order is placed by a customer. Efficiently manage and process incoming orders through the app.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. **Delivery Coordination:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- The Streetside Runner app handles delivery logistics. Once you receive an order, our runners will be promptly dispatched to pick up the items and deliver them to our valued customers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. **Promotions and Specials:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Maximize your visibility by offering exclusive promotions and deals to attract more customers. Streetside Stores provides the perfect platform to showcase your business.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>6. **Customer Engagement:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Engage with your customers, respond to reviews, and build lasting relationships through our platform. Excellent customer service is a cornerstone of success.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7. **24/7 Support:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Our dedicated support team is available around the clock to assist you with any inquiries or issues you may encounter. Please don&#39;t hesitate to reach out to us whenever you need help.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you for choosing Streetside Stores to grow your business and connect with the local community. We believe that together, we can create an exceptional experience for our customers while expanding your reach and revenue.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have any questions during the onboarding process or need further assistance, please do not hesitate to contact us at <a href=\"mailto:edmund@streetsideco.com\">edmund@streetsideco.com</a> or whatsapp:6205821</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Once again, welcome aboard! We look forward to a successful partnership with your esteemed establishment.</p>',NULL,NULL),(37,'App\\Models\\EmailTemplate',8,'en','button_name','',NULL,NULL),(38,'App\\Models\\EmailTemplate',8,'en','footer_text','Please contact us for any queries; were always happy to help.',NULL,NULL),(39,'App\\Models\\EmailTemplate',8,'en','copyright_text',' 2023 6amMart. All rights reserved.',NULL,NULL),(40,'App\\Models\\EmailTemplate',9,'en','title','Congratulations! Your Registration is Approved!',NULL,NULL),(41,'App\\Models\\EmailTemplate',9,'en','body','<p>Hey there,</p>\r\n\r\n<p>We are thrilled to welcome you to Streetside Stores, Belize&#39;s premier food delivery and service platform! Congratulations on joining our dynamic network of local businesses, where we connect you with countless customers seeking the best in their neighborhoods.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>At Streetside Stores, we are committed to helping businesses like yours thrive by providing a seamless and efficient platform to reach a broader audience. Whether you&#39;re a restaurant, bar, or retail store, we are excited to partner with you to elevate your services and offer convenience to our ever-growing user base.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Here&#39;s a quick guide to getting started with Streetside Stores:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. **Merchant App - Streetside Managers:**</p>\r\n\r\n<p>&nbsp;&nbsp;