siness and connect with the local community. We believe that together, we can create an exceptional experience for our customers while expanding your reach and revenue.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have any questions during the onboarding process or need further assistance, please do not hesitate to contact us at <a href=\"mailto:edmund@streetsideco.com\">edmund@streetsideco.com</a> or whatsapp:6205821</p>',NULL,NULL),(42,'App\\Models\\EmailTemplate',9,'en','button_name','',NULL,NULL),(43,'App\\Models\\EmailTemplate',9,'en','footer_text','Once again, welcome aboard! We look forward to a successful partnership with your esteemed establishment.',NULL,NULL),(44,'App\\Models\\EmailTemplate',9,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(45,'App\\Models\\EmailTemplate',11,'en','title','Congratulations! Your Withdrawal is Approved!',NULL,NULL),(46,'App\\Models\\EmailTemplate',11,'en','body','<p>Dear User,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The amount you requested to withdraw is approved by the Admin and transferred to you bank account.</p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL),(47,'App\\Models\\EmailTemplate',11,'en','button_name','See details',NULL,NULL),(48,'App\\Models\\EmailTemplate',11,'en','footer_text','Please contact us for any queries; were always happy to help.',NULL,NULL),(49,'App\\Models\\EmailTemplate',11,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(50,'App\\Models\\EmailTemplate',23,'en','title','Please Register with The OTP',NULL,NULL),(51,'App\\Models\\EmailTemplate',23,'en','body','<p>ONE MORE STEP:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please copy the following OTP &amp; paste in on your sign-up page to complete your registration.</p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL),(52,'App\\Models\\EmailTemplate',23,'en','button_name','',NULL,NULL),(53,'App\\Models\\EmailTemplate',23,'en','footer_text','Please contact us for any queries; were always happy to help.',NULL,NULL),(54,'App\\Models\\EmailTemplate',23,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(55,'App\\Models\\EmailTemplate',26,'en','title','Your Order is Successful',NULL,NULL),(56,'App\\Models\\EmailTemplate',26,'en','body','<p>Hi <strong>{userName}</strong>,</p>\r\n\r\n<p>Your order is successful. Please find your invoice below.</p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL),(57,'App\\Models\\EmailTemplate',26,'en','button_name','Track Order',NULL,NULL),(58,'App\\Models\\EmailTemplate',26,'en','footer_text','Please contact us for any queries; were always happy to help.',NULL,NULL),(59,'App\\Models\\EmailTemplate',26,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(60,'App\\Models\\EmailTemplate',22,'en','title','Your Registration is Successful!',NULL,NULL),(61,'App\\Models\\EmailTemplate',22,'en','body','<p>Hi <strong>{userName}</strong>,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Congratulations and welcome to Streetside Stores! We&#39;re excited to have you on board, and we appreciate you choosing our app to satisfy your cravings conveniently and efficiently.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Now that you&#39;ve successfully downloaded the Streetside Stores app, your journey to exploring a world of delightful deliveries has just begun. Get ready to indulge in the finest local offerings, delivered right to your doorstep!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Here&#39;s a brief guide to help you make the most of your Streetside Stores experience:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. **Discover Local Gems:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Start by opening the app and exploring the wide range of restaurants, bars, and stores available in your area.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Browse through their mouth-watering menus and exciting product listings to find your favorites.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. **Place Your Order:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Select your desired items, add them to your cart, and customize your order as needed.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Choose your delivery address and preferred payment method with just a few taps.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. **Fast and Reliable Delivery:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Sit back and relax while our dedicated Streetside Runners ensure your order reaches you promptly and safely.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Use our real-time tracking feature to stay updated on the status of your order from the moment it&#39;s placed until it arrives at your doorstep.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. **Exclusive Offers and Promotions:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Keep an eye out for special deals, promotions, and seasonal offers to enhance your experience and save on your orders.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. **Customer Support:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Our friendly customer support team is always available to assist you with any questions or concerns. Reach out to us at [Customer Support Email/Phone Number] for a quick response.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We are committed to providing you with a seamless and delightful delivery experience. Your satisfaction is our priority, and we&#39;re continuously working to improve our services based on your feedback.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you once again for choosing Streetside Stores. We&#39;re excited to be a part of your daily life and help make your days more enjoyable and convenient.</p>',NULL,NULL),(62,'App\\Models\\EmailTemplate',22,'en','button_name','',NULL,NULL),(63,'App\\Models\\EmailTemplate',22,'en','footer_text','Get ready to explore the best in your neighborhood and indulge in what you crave, all at the touch of a button. Welcome to the Streetside Stores family!',NULL,NULL),(64,'App\\Models\\EmailTemplate',22,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(65,'App\\Models\\EmailTemplate',16,'en','title','Join Streetside Stores as a Runner',NULL,NULL),(66,'App\\Models\\EmailTemplate',16,'en','body','<p>Hi <strong>{userName}</strong>,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you for your interest in becoming a part of the Streetside Stores team as a Runner! We are thrilled to welcome you to our dynamic community of dedicated drivers, where you get to deliver what our valued clients crave right to their doors, all while enjoying the flexibility of working on your schedule.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>At Streetside Stores, we believe in empowering local drivers like you to play a crucial role in delivering happiness and convenience to customers across Belize. Here&#39;s a quick guide to help you get started on your journey as a Streetside Runner:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. **Download the Streetside Runner App:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Head over to the App Store or Google Play Store to download the Streetside Runner app.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Sign up using your email address and create a secure password for your account.</p>\r\n\r\n<h3>-- Providing you have not--</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. **Complete Your Profile:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Provide essential details, including your name, contact information, and a profile picture. Having a profile picture helps our valued customers recognize you when you deliver their orders.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. **Manage Your Availability:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Enjoy the flexibility of choosing your own working hours. Set your availability within the app, and we&#39;ll match you with delivery opportunities that suit your schedule.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. **Accept Delivery Requests:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- As orders come in, you&#39;ll receive notifications about available delivery opportunities.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Accept the ones that fit your schedule and preferences, and you&#39;re all set to start delivering.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. **Deliver with Ease:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Use the in-app navigation to reach the pickup location and the customer&#39;s address swiftly and smoothly.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Enjoy the satisfaction of delivering orders promptly and ensuring customer satisfaction.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>6. **Earn and Grow:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Receive earnings for each successful delivery, including tips from satisfied customers.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- As you consistently deliver exceptional service, you&#39;ll have the chance to earn even more.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7. **Customer Support:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Our support team is here to assist you with any questions or concerns. Feel free to reach out to us at [Customer Support Email/Phone Number].</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you for joining the Streetside Stores team as a Runner. Your role is invaluable in helping us provide outstanding delivery services to our customers. Together, let&#39;s make every delivery experience exceptional!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have any questions during the onboarding process or need further assistance, please don&#39;t hesitate to contact us. We&#39;re here to support you every step of the way.</p>',NULL,NULL),(67,'App\\Models\\EmailTemplate',16,'en','button_name','',NULL,NULL),(68,'App\\Models\\EmailTemplate',16,'en','footer_text','Welcome aboard, and let\'s hit the road to delivering convenience and smiles!',NULL,NULL),(69,'App\\Models\\EmailTemplate',16,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(70,'App\\Models\\EmailTemplate',17,'en','title','Congratulations! You\'re Now an Official Streetside Runner!',NULL,NULL),(71,'App\\Models\\EmailTemplate',17,'en','body','<p>Hi <strong>{userName}</strong>,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Congratulations and a warm welcome to the Streetside family! We are excited to inform you that your application as a Runner has been approved, and you are now an essential part of our esteemed team of delivery drivers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As a Streetside Runner, you play a vital role in connecting our valued customers with the best in their neighborhoods. Your dedication to providing excellent service and timely deliveries will make a significant impact on their experience.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Here&#39;s a quick recap of what to expect as an official Streetside Runner:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. **Streetside Runner App:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Use the Streetside Runner app to manage your availability and accept delivery requests at your convenience.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. **Deliver with Confidence:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Make use of the in-app navigation to reach pickup locations and customer addresses efficiently.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Deliver orders promptly and with a friendly smile to ensure customer satisfaction.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. **Earn and Grow:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- You&#39;ll receive earnings for each successful delivery, including any tips provided by happy customers.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- As you consistently deliver exceptional service, you&#39;ll have the opportunity to earn even more.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. **Customer Support:**</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;- Our support team is always available to assist you with any questions or concerns. Reach out to us at [Customer Support Email/Phone Number] for any assistance you may need.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you for joining Streetside Stores as a Runner. Your role is critical to the success of our platform, and we are confident that you&#39;ll excel in providing outstanding delivery experiences to our customers.</p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL),(72,'App\\Models\\EmailTemplate',17,'en','button_name','',NULL,NULL),(73,'App\\Models\\EmailTemplate',17,'en','footer_text','Welcome to the team, and let\'s hit the road to deliver happiness and convenience together!',NULL,NULL),(74,'App\\Models\\EmailTemplate',17,'en','copyright_text',' 2023 Streetside. All rights reserved.',NULL,NULL),(75,'App\\Models\\Store',2,'en','name','Papa Churros',NULL,NULL),(76,'App\\Models\\Store',2,'en','address','#7 Second Street, San Ignacio',NULL,NULL),(77,'App\\Models\\RefundReason',1,'en','reason','Item is broken',NULL,NULL),(78,'App\\Models\\RefundReason',2,'en','reason','Late Delivery',NULL,NULL),(79,'App\\Models\\RefundReason',3,'en','reason','Damaged item',NULL,NULL),(80,'App\\Models\\RefundReason',4,'en','reason','Wrong item',NULL,NULL),(81,'App\\Models\\RefundReason',5,'en','reason','Technical Glitches',NULL,NULL),(82,'App\\Models\\RefundReason',6,'en','reason','Unsatisfactory Service',NULL,NULL),(83,'App\\Models\\Module',2,'en','module_name','Parcel',NULL,NULL),(84,'App\\Models\\Module',2,'en','description','<p>Experience hassle-free parcel delivery with Streetside Parcels. Our user-friendly platform connects you to trusted couriers for secure and timely package transportation.</p>',NULL,NULL),(85,'App\\Models\\DataSetting',71,'en','fixed_location_title','North Bullet Tree, San Ignacio',NULL,NULL),(86,'App\\Models\\DataSetting',68,'en','fixed_header_title','Streetside',NULL,NULL),(87,'App\\Models\\DataSetting',69,'en','fixed_header_sub_title','From Streetside Stores to you',NULL,NULL),(88,'App\\Models\\DataSetting',86,'en','privacy_policy','<h1><strong>Privacy Policy</strong></h1>\r\n\r\n<p>Last updated: December 14th, 2021</p>\r\n\r\n<p>At Streetside, your privacy is important to us. In this Privacy Policy, we tell you what information we collect, share with others, and how we use it.</p>\r\n\r\n<h3><strong>Scope of this Privacy Policy</strong></h3>\r\n\r\n<p>Streetside (&ldquo;Streetside,&rdquo; &ldquo;we,&rdquo; &ldquo;our,&rdquo; and/or &ldquo;us&rdquo;) values the privacy of individuals who use our website and mobile apps (collectively, our &ldquo;Platform&rdquo;). This privacy policy (the &ldquo;Privacy Policy&rdquo;) explains how we collect, use, and share information from Streetside&rsquo;s users (&ldquo;Users&rdquo;). It applies to our customers (&ldquo;Customers&rdquo;), individuals who deliver products requested by Customers through our Platform (&ldquo;Runners&rdquo;), anyone who signs up to become a Runner (&ldquo;Prospective Runners&rdquo;), businesses selling products through our Platform (&ldquo;Merchants&rdquo;), and other partners and/or end-users who use our Platform to facilitate delivery and/or sale of products (&ldquo;Partners&rdquo;). By using the Platform, you agree to the Privacy Policy and any future amendments and additions. Your use of our Platform is also subject to our Terms of Service.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>1. Information Streetside Collects From Users</strong></h3>\r\n\r\n<p>Streetside collects information from its Users. The categories of information we collect are described below in this Section 1.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>A. Information You Provide Directly to Us</strong></p>\r\n\r\n<p><strong>Customers</strong></p>\r\n\r\n<p><em>Sign Up and Profile Information</em>. When you sign up and/or place an order through Streetside as a Customer, you provide us with information, including, but not limited to your name, email address, physical address, and phone number. If you sign up using your Facebook account, we receive information including your name and email address. After registration, Customers can add multiple delivery addresses to their profile. You may be required to provide us with a photograph.</p>\r\n\r\n<p><em>Order Information</em>. When you place an order, we collect information related to the order, which may include items purchased, special instructions, date and time of order, and subtotal.</p>\r\n\r\n<p><em>Feedback</em>. We may ask you for feedback on your order, which may include a rating of experience, the applicable Merchant, and/or the applicable Runner. A review option is presented after each order&nbsp;</p>\r\n\r\n<p><em>Surveys</em>. We may offer an opportunity to participate in surveys, promotions, or contests. When a user participates, we may request certain information which may include name and email address.</p>\r\n\r\n<p><em>Payment Information</em>. When you add a payment card to your Streetside account, a third-party payments service provider receives your card information. We do not store full payment card information on our servers.</p>\r\n\r\n<p><strong>Active and Prospective Runners</strong></p>\r\n\r\n<p><em>Sign Up and Profile Information</em>. When you sign up to become a Runner, you may provide us with certain information, including, but not limited to your legal name, date of birth, email address, physical address, phone number, photo, vehicle information, and car insurance information. We share this information with third-party providers who initiate background check reports on you. Additional information about the third parties who run the background checks is provided in Section C below. We may also collect information from you after sign-up as is necessary to effectively operate the Platform.</p>\r\n\r\n<p><em>Surveys</em>. We may offer an opportunity to participate in surveys, promotions, or contests. When a user participates, we may request certain information which may include name and email address.</p>\r\n\r\n<p><em>Payment Information</em>. We receive information from Runners to provide payment and for tax reporting purposes, including but not limited to bank account and tax information.</p>\r\n\r\n<p><strong>Merchants and Partners</strong></p>\r\n\r\n<p><em>Profile Information</em>. A Merchant who signs up for our Platform or a Partner who utilizes our Platform provides us with certain information, including, but not limited to contact name, phone number, email address, physical address, hours, and product information, including product details and price.</p>\r\n\r\n<p><em>Payment Information</em>. We may receive Merchants&rsquo; bank account information to provide payment as well as any other information necessary to set up payment.</p>\r\n\r\n<p><strong>All Users</strong></p>\r\n\r\n<p><em>Communications</em>. If you contact us directly, we may collect additional information about you. For example, when you contact our Customer Support team or text with us and our Runners, we will receive and may retain your name, email address, and the contents of any message or attachments that you may send to us, as well as any other information you choose to provide.</p>\r\n\r\n<p><em>Feedback</em>. Customers and Runners may be able to rate and review each other at the end of every delivery. Customers may be able to see a Runner&rsquo;s aggregate ratings during a delivery. After delivery, we may share feedback or comments that Customers provide with Runners and/or Merchants, but we will not identify the Customer. If you are a Customer and do not want a Runner to know you provided certain feedback or comments, please do not include identifying information in that feedback or those comments. We may also share with Runners their aggregate ratings. Customers may also provide us information and feedback related to your experience on the Platform, including, but not limited to order reviews, merchant reviews, and merchant ratings.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>B. Information We Collect Automatically Through Your Use of the Platform</strong></p>\r\n\r\n<p><em>Location and Sensor Information</em>. We receive a Customer&rsquo;s location information when you&rsquo;re using the Streetside app, including when the app is in use in the foreground or background. We may continuously collect location information and other motion-generated or orientation-generated mobile sensor data from Runners and Prospective Runners when the Streetside app is in use in the foreground or background to personalize the app experience, assist in finding available markets and/or available delivery opportunities, offer delivery incentives, track the progress and completion of deliveries, and other similar purposes. We also use this information for analytics purposes. For information on your choices for sharing location information, please consult Section 6 on Your Choices.</p>\r\n\r\n<p><em>Device Information</em>. We receive information from Users&rsquo; devices, including IP address, web browser type, mobile operating system version, phone carrier and manufacturer, unique device identifiers, other information such as your device type, and if you register with your Facebook account, your Facebook identifier.</p>\r\n\r\n<p><em>Usage Information</em>. We automatically receive information about your interactions with our Platform, such as the pages you were visiting before accessing the Site or mobile application, or other content you view, the products you search for or purchase, and the dates and times of your visits, to help us understand how you use our Platform, help us improve our Platform, and provide you information about our Platform, Merchants, and Partners.</p>\r\n\r\n<p><em>Call and Text Information</em>. We work with one or more third parties to facilitate phone calls and text messages between Customers and Runners who are delivering the Customers&rsquo; products. We receive information about these communications including the date and time of the call or text message, the party&rsquo;s phone numbers, and the content of the text messages. By using Streetside services, including communicating with Streetside and your Runner, you consent to the receipt, recording, and monitoring by Streetside of text messages between you and Runners for quality assurance, customer service, security, and fraud prevention. We do not record or have access to the content of the phone calls between Customers and Runners. We do record and/or have access to the content of phone calls between Users and Streetside Merchants or Runners.</p>\r\n\r\n<p><em>Information from Cookies and Similar Technologies</em>. We and our service providers collect information through the use of &ldquo;cookies&rdquo; and similar technologies to understand how you navigate through and interact with our Platform, to learn what content is popular, for authentication and advertising purposes, and to save your preferences. Cookies are small text files that web servers place on your device; they are designed to store basic information and to help websites and apps recognize your browser. We may use both session cookies and persistent cookies. A session cookie disappears after you close your browser. A persistent cookie remains after you close your browser and may be accessed every time you use our Platform.&nbsp;</p>\r\n\r\n<p><em>Referrals</em>. You may be able to refer Streetside to friends and other contacts. To help you do this, we may request that you can grant us access to your mobile device address book. You can then direct us to send referral text messages or referral emails to contacts you select in your address book. We will use the data from your address book only to process your referral. By sending a referral, you also consent to Streetside sending your public profile image to the contacts you select to receive a referral link. By choosing to invite a friend you represent that you have received the friend&rsquo;s consent to provide his or her name and email address with Streetside. Streetside will use that information to send an email inviting him or her to visit the Platform and will store that information to track the success of the referral program. Streetside may also send marketing emails.</p>\r\n\r\n<p>Streetside users may not send, publish, or share any false, misleading, or deceptive communications in connection with participation in the referral program. These actions may violate various federal state and/or international laws, including, but not limited to, the regulations and policies of the Federal Trade Commission. In addition, Streetside users may not send any referral emails, text messages, or other communications to children under the age of 13.</p>\r\n\r\n<p>If you are referred to Streetside through one of our referral programs, or if someone attempts to refer you, Streetside may share your name, whether you already signed up for Streetside, whether you are a new customer, and whether you have placed a qualifying order with the person(s) who referred you.</p>\r\n\r\n<p><strong>C. Personal Information from Publicly-Available Sources and Third Parties</strong></p>\r\n\r\n<p><em>Information We Receive From Partners</em>. If you purchase through one of our Partners that offers delivery with Streetside, we receive information about your purchase, including your name, phone number, the product you purchased, and the delivery location.</p>\r\n\r\n<p><em>Background Information on Runners</em>. Streetside works with third-party providers to perform driving records and criminal background checks on Prospective Runners and active Runners, and in some instances, these third parties provide Prospective Runners&rsquo; and active Runners&rsquo; records to Streetside as part of the background check process.</p>\r\n\r\n<p><em>Information From Affiliates and Non-Affiliated Third Parties.</em>&nbsp;We may collect information about you or others through Streetside affiliates or non-affiliated third parties. For example, you may be able to access the Platform through a social networking account, such as Facebook. If you access the Platform through your Facebook account, you may allow us to have access to certain information in your Facebook profile. This may include your name, profile picture, gender, networks, and/or email address and other information you allow to be imported from Facebook, which is controlled in your Facebook privacy settings.</p>\r\n\r\n<p>Social networking sites, such as Facebook, have their policies for handling your information. For a description of how these sites may use and disclose your information, including any information you make public, please consult the sites&rsquo; privacy policies. We have no control over how any third-party site uses or discloses the personal information it collects about you.</p>\r\n\r\n<p>We may also collect information about you or others through non-affiliated third parties. For example, to the extent permitted by law, we may, in our sole discretion, ask for and collect supplemental information from third parties, such as information about your credit from a credit bureau, or information to verify your identity or trustworthiness, or for other fraud or safety protection purposes. We may also collect demographic information, which may include information such as income, marital status, spending habits, and other information about customers. We may combine information that we collect from you through the Platform with information that we obtain from such affiliated and non-affiliated third parties and information derived from any other products or services we provide.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>2. How We Use The Information We Collect From Users</strong></h3>\r\n\r\n<p>We use the information collected from and about Users for the following business and commercial purposes:</p>\r\n\r\n<ol>\r\n	<li>Provide services and features. Streetside uses the data we collect to provide, personalize, improve, expand, and promote our Platform and other services. This includes using data to:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Facilitate transactions, deliveries, and payments.</li>\r\n	<li>Analyze how you use our Platform.</li>\r\n	<li>Track and share progress of deliveries and orders.</li>\r\n	<li>Notify you about the progress of deliveries and orders.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>Communications. Streetside uses the data we collect to communicate with you, either directly or through one of our service providers, including for marketing and promotional purposes, and to respond to any issues that may arise during deliveries.</li>\r\n</ol>\r\n\r\n<p>Streetside also uses the data we collect to provide customer support, including but not limited to responding to customer support questions or your requests, and investigating and addressing User concerns.</p>\r\n\r\n<ol>\r\n	<li>Conduct research and development. Streetside may use the data we collect for testing, analysis, product development, and machine learning to improve a user&rsquo;s experience on the Platform.</li>\r\n	<li>Security and safety. We use the information we collect to help maintain the safety, security, and integrity of our services, third parties, and Users. This includes using data to:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Find and prevent fraud.</li>\r\n	<li>Protect Users and the Streetside business.</li>\r\n	<li>Provide account and network security.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>Maintain legal and regulatory compliance. Streetside may use the information we collect to maintain legal and regulatory compliance. This includes using data to:</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Resolve disputes, to enforce any legal terms that govern your use of the Platform.</li>\r\n	<li>Pay our taxes or fulfill our business obligations.</li>\r\n	<li>Respond to requests by regulators, government entities, and official inquiries.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>Streetside business purposes. We may aggregate and/or de-identify information collected through the Platform. We may use de-identified or aggregated data for any purpose, including without limitation for research and marketing purposes, and may also share such data with any third parties, including without limitation, advertisers, promotional partners, sponsors, event promoters, and/or others.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>3. How Streetside Shares Information It Collects From Users</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>A. Sharing between Customers and Runners</strong></p>\r\n\r\n<p>To facilitate the delivery of orders, Runners and Customers may have access to certain information about each other. When Runners are offered delivery opportunities, they may be able to see the Customer&rsquo;s delivery location. Once a Runner accepts a delivery request from a Customer, the Customer may see the Runner&rsquo;s first name and last initial, photo, the aggregate rating, real-time location (which may reveal locations of other Customers to whom a Runner is providing a delivery), and/or other information to identify the Runner, including, but not limited to the Runner&rsquo;s license plate, and color, make, and model of vehicle. Runners may see the Customer&rsquo;s first name and last initial, and the Customer&rsquo;s delivery address and/or real-time location. Streetside allows Customers and Runners to call and text each other. Customer and Runner phone numbers are masked and, only in rare instances, may they be able to see the other&rsquo;s phone number. As described above, Customers can see a Runner&rsquo;s aggregate ratings during a delivery. After delivery, we may share feedback or comments that a Customer provides with a Runner, but we will not identify the Customer. If you are a Customer and do not want a Runner to know you provided certain feedback or comments, please do not include identifying information in that feedback or those comments. We may also share with Runners their aggregate ratings.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>B. Sharing between Runners and Merchants</strong></p>\r\n\r\n<p>Before a Runner picks up the delivery from the Merchant and/or Partner and during the delivery, the Merchant and/or Partners may be able to see the Runner&rsquo;s name, real-time location, and may be able to communicate directly with the Runner.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>C. Sharing between Customers and Merchants</strong></p>\r\n\r\n<p>We may share certain transactional details with Merchants from whom you&rsquo;ve placed orders, such as your name, phone number, email address, and/or any physical address associated with your account or any delivery, with the Merchants from whom you&rsquo;ve placed orders. Merchants may also have access to your public profile image, your feedback, and/or order information, including your purchase history and other information related to your orders with the particular Merchant. Such information provided to Merchants is not subject to this Privacy Policy but instead is subject to Merchant&rsquo;s privacy policies which may allow Merchant to, among other things, send you marketing communications and other promotional content.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>D. Service Providers</strong></p>\r\n\r\n<p>We share your information with service providers that perform services on our behalf, including all of the uses described in this Section 3. Some examples of service providers are third parties we use for payment processing, advertising, marketing, and analytics.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>E. Other Sharing</strong></p>\r\n\r\n<p>We may share your information with third parties in the following cases:</p>\r\n\r\n<ul>\r\n	<li>Where disclosure is required or appropriate to comply with laws, regulations, legal process, or an agency or governmental request;</li>\r\n	<li>With law enforcement officials, government authorities, or third parties, if we think doing so is necessary to protect the rights, property, or safety of Streetside, our Users, or the public;</li>\r\n	<li>To protect the security or integrity of our Platform;</li>\r\n	<li>To enforce our agreements, policies, and Terms of Service;</li>\r\n	<li>To respond to an emergency which we believe in good faith requires us to disclose information to assist in preventing the death or serious bodily injury of any person;</li>\r\n	<li>To investigate and defend ourselves or others against any third-party claims or allegations;</li>\r\n	<li>To provide information about the use of our Platform to Runners, Merchants, Partners, or potential business partners in an aggregated or de-identified form that cannot reasonably be used to identify you;</li>\r\n	<li>While negotiating or about a business transaction, such as a merger, sale of assets, or bankruptcy;</li>\r\n	<li>Whenever you consent to the sharing, including without limitation when you use the social features of the Platform to (1) review, rate, and/or provide feedback on Merchants that will be available for viewing by other Users; (2) share the orders you&rsquo;ve placed through the Platform with other Users, including, but not limited to designated favorite orders; and/or (3) share your favorite items/Merchants or lists of items/Merchants with other Users; and</li>\r\n	<li>When you share certain information related to orders with other Users or non-Users, including, but not limited to (a) your cart; (b) the fees associated with your Order (e.g. to split payment with others); (c) the estimated time of delivery and progress of your Order; and/or (d) order destination.</li>\r\n</ul>\r\n\r\n<h3><strong>4. Online Analytics &amp; Interest-Based Advertising</strong></h3>\r\n\r\n<p>We or third parties may place cookies, web beacons, or other tracking technologies on your computer, mobile phone, or other devices to collect information about your use of the Platform. Cookies are small bits of data we store on the device (computer, mobile phone, tablet, or any other mobile device) that you use to access the Platform. We use cookies and other tracking technologies to (a) inform, optimize, and serve marketing content based on past visits to our websites and other sites, (b) report how our marketing content impressions, other uses of marketing services, and interactions with these marketing impressions and marketing services are related to visits to our websites, (c) help us understand how the Platform is being used, (d) let you navigate between pages efficiently, (d) remember your preferences, and (e) generally improve your browsing experience. We also allow other third parties (e.g., ad networks and ad servers such as Google Analytics, DoubleClick, and others) to serve tailored marketing to you and to access their cookies or other tracking technologies on your computer, mobile phone, or other devices you use to access the Platform. We neither have access to, nor does this Privacy Policy govern, the use of cookies or other tracking technologies that may be placed on your computer, mobile phone, or other devices you use to access the Platform by non-affiliated, third-party ad technology, ad servers, ad networks or any other non-affiliated third parties. Those parties that use these technologies may offer you a way to opt-out of targeted advertising as described below. You may receive tailored advertising on your computer through a web browser. Cookies may be associated with de-identified data linked to or derived from data you voluntarily have submitted to us (e.g., your email address) that we may share with a service provider in hashed, non-human-readable form.</p>\r\n\r\n<p>We and our third-party vendors may use Device IDs and other automated technologies (including cookie identifiers on our website), along with other collected information, to deliver content or tailor ads when you are on our Platform or other devices, apps, or websites. These ads may be based, for instance, on the types of websites that you visit over time, the types of apps you have on your device, or de-identified information about you and your likely interests, based on your activities off of our Platform. This type of advertising is often called &ldquo;interest-based&rdquo; or &ldquo;personalized&rdquo; advertising&mdash;and when it occurs on mobile apps, &ldquo;cross-app&rdquo; advertising.</p>\r\n\r\n<p>Partners that we or others work with to do the above may track your activities over time (including across different apps or websites) by collecting information through automated means, and they may use this information, and other information they receive from us or other sources, to deliver advertisements to you. If you are interested in more information about tailored browser advertising and how you can generally control cookies from being put on your computer to deliver tailored marketing, you may visit the<a href=\"http://www.networkadvertising.org/choices\" target=\"_blank\">&nbsp;Network Advertising Initiative&rsquo;s Consumer Opt-Out Link</a>&nbsp;and/or the<a href=\"http://www.aboutads.info/choices\" target=\"_blank\">&nbsp;Digital Advertising Alliance&rsquo;s Consumer Opt-Out Link</a>&nbsp;to opt-out of receiving tailored advertising from companies that participate in those programs. To opt-out of Google Analytics for Display Advertising or customize Google Display Network ads, you can visit the<a href=\"https://www.google.com/settings/ads\" target=\"_blank\">&nbsp;Google Ads Settings page</a>. You can also opt-out of cross-app advertising by following the instructions for your operating system, (iOS for Apple phones, Android for Android devices, and Windows for Microsoft devices). Please note that to the extent advertising technology is integrated into the Platform, you may still receive advertising content even if you opt-out of tailored advertising. In that case, the advertising content will just not be tailored to your interests. Also, we do not control any of the above opt-out links and are not responsible for any choices you make using these mechanisms or the continued availability or accuracy of these mechanisms. If your browsers are configured to reject cookies when you visit this opt-out page, or you subsequently erase your cookies, use a different computer or change web browsers, your NAI or DAA opt-out may no longer be effective. Additional information is available on NAI&rsquo;s and DAA&rsquo;s websites, accessible by the above links.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>5. Social Media Usage</strong></h3>\r\n\r\n<p>You may choose to enable or log in to our Platform via various online services, including social networking services like Facebook and Google(not released to writing). Our Services also may enable you to access social networking services such as Facebook, Twitter, Instagram, or Snapchat (collectively, &ldquo;Social Network&rdquo;) directly or indirectly through our Platform.</p>\r\n\r\n<p>When you link a Social Network account to Streetside or log into our Platform using your Social Network account, we may collect relevant Personal Information necessary to enable our Platform to access that Social Network and your data contained within that Social Network. We also may share your information with the operator of that Social Network to facilitate or enhance the delivery of that Social Network or other services to you. A Social Network may provide us with access to certain information that you have provided to them, and we will use, store, and disclose such information under this Privacy Policy. Additionally, a Social Network may collect information, including information about your use of our Platform automatically. How a Social Network collects, uses, stores, and discloses your information is governed by the policies of such third parties and Streetside shall have no liability or responsibility for the privacy practices or other actions of any Social Network that may be enabled within our Platform.</p>\r\n\r\n<p>You may also have the option of posting your activities on our Platform and other content to a Social Network when you access content through our Platform. For example, you may post to Facebook that you placed an order with Streetside. Keep in mind that your usage of Social Network features is governed by applicable Social Networks and not by Streetside, and may be visible or accessible to the public.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>6. Your Choices</strong></h3>\r\n\r\n<p>In addition to other choices described in this Privacy Policy and the Platform, you have other choices regarding your information:</p>\r\n\r\n<p>Location Information. While you can prevent your device from sharing location information at any time through your device&rsquo;s operating system settings, Customer and Runner location is core to our Platform and without it, you may not be able to successfully use our Platform.</p>\r\n\r\n<p>Email Subscriptions. You can always unsubscribe from our promotional emails via the link provided in the emails. Even if you opt-out from receiving promotional messages from us, you will continue to receive administrative messages from us.</p>\r\n\r\n<p>Account Deletion. If you would like to delete your Streetside account, please contact us through our Help Center with your request. If you choose to delete your account, we will delete it for you, but may retain certain information to collect any fees owed, resolve disputes, troubleshoot problems, analyze usage of the Platform, assist with any investigations, prevent fraud, enforce our Terms of Service, or take other actions as required or permitted by law and/or regulations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>7. Third-Party Links</strong></h3>\r\n\r\n<p>Our Platform may contain links to other websites, products, or services that we do not have control over. Please be aware that we are not responsible for the privacy practices of such third parties. We encourage you to read their privacy policies before giving them your information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>8. Data Security</strong></h3>\r\n\r\n<p>We are committed to protecting your information. We use administrative, logical, physical, and managerial measures to safeguard your personal information against loss, theft, and unauthorized access, use, and modification. Unfortunately, no security measures can be 100% secure, so we cannot guarantee the security of Users&rsquo; data. While we do our best to protect your information, you are also responsible for protecting your information by, for example, protecting your account credentials. If you have any reason to believe that your account has been compromised, please notify us immediately through our Help Center.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>9. Children&rsquo;s Privacy</strong></h3>\r\n\r\n<p>Streetside is not directed to children, and we do not knowingly collect personal information from children under 13. If you believe that a child under the age of 13 has given us personal information, please contact us via our Help Center.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>10. Consent to Transfer</strong></h3>\r\n\r\n<p>Our computer systems are currently based in Belize, so your data will be processed by us in Belize, where data protection and privacy regulations may not offer the same level of protection as in other parts of the world. If you create an account with the Platform as a visitor from outside Belize, by using the Platform, you agree to this Privacy Policy and you consent to the transfer of all such information to Belize, which may not offer a level of protection equivalent to that required in certain other countries, and to the processing of that information as described in this Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>11. Other Important Information</strong></h3>\r\n\r\n<p>Parts of the Platform may include third-party integrations such as Google Maps features and content, including the Google Maps API(s). Your use of these services is subject to their respective privacy policies such as the Google Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>12. Changes to Our Privacy Policy</strong></h3>\r\n\r\n<p>We may make changes to this Privacy Policy from time to time. If we make any changes, we will revise the &ldquo;Last Updated&rdquo; date at the top of this Privacy Policy. If we make any material changes, we will let you know through the Platform, by email, or other communication. We encourage Users to read this Privacy Policy periodically to stay up-to-date about our privacy practices. As long as you use the Platform, you are agreeing to this Privacy Policy and any updates we make to it.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>13. Contact Information</strong></h3>\r\n\r\n<p>Feel free to contact us at any time with any questions or comments about this Privacy Policy, your personal information, our use and sharing practices, or your choices regarding your information by contacting us at our Help Center.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>14. User Deletion</strong></h3>\r\n\r\n<p>To delete your account you just need to go to your account settings and click &quot;delete this account&quot;. It will ask to confirm your account deletion and the account will be deleted. You will also receive an email stating that the user deletion process has been completed.</p>',NULL,NULL),(89,'App\\Models\\DataSetting',87,'en','terms_and_conditions','<h1>Streetside Service Agreement (Terms &amp; Conditions)</h1>\r\n\r\n<p>Thank you for your interest in the Streetside application( Streetside Stores, Streetside Restaurant, Streetside Delivery, or Streetside Manager) for your mobile device (the &ldquo;App&rdquo;) provided to you by Streetside Co. (&ldquo;Streetside&rdquo;, &ldquo;us&rdquo; or &ldquo;we&rdquo;), and our web site at<a href=\"https://www.streetsideco.com/\">&nbsp;Streetsideco.com</a>&nbsp;(the &ldquo;Site&rdquo;), as well as all related web sites, networks, and downloadable software provided by us and on which a link to these Terms of Service is displayed (collectively, together with the App and Site, our &ldquo;Platform&rdquo;). These Terms of Service (these &ldquo;Terms&rdquo;), including the Privacy Policy incorporated into these Terms by reference and any other applicable policies and guidelines, as may be updated from time to time, govern your use of the Platform. These Terms constitute a legal agreement between you and Streetside. In order to use the Platform you must agree to these Terms.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>All references to &ldquo;you&rdquo; or &ldquo;your,&rdquo; as applicable, mean the person who accesses, uses, and/or participates in the Platform in any manner, and each of your heirs, assigns, and successors. If you use the Platform on behalf of an entity, organization, or company, you represent and warrant that you have the authority to bind that entity to these Terms, your acceptance of the Terms will be deemed an acceptance by that entity, and &ldquo;you&rdquo; and &ldquo;your&rdquo; herein shall refer to that entity.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>BY DOWNLOADING, INSTALLING, OR OTHERWISE ACCESSING OR USING THE PLATFORM, YOU AGREE THAT YOU HAVE READ, UNDERSTOOD, AND AGREE TO BE BOUND BY THESE TERMS. IF YOU DO NOT AGREE, YOU MAY NOT USE THE PLATFORM.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>STREETSIDE PLATFORM</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform connects consumers with retail stores, and restaurants (&ldquo;Merchants&rdquo;), and with independent contractor couriers (&ldquo;Couriers&rdquo;), to facilitate on-demand delivery or pickup services. Through the Platform, consumers may request that merchandise or food be made available for pick-up or delivered to them from a Merchant by Couriers who contract with Streetside to access the Platform and receive delivery opportunities.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside is not a retail store, restaurant, food delivery platform, merchandise delivery platform or food preparation entity. Streetside is not liable or responsible for Merchants&rsquo; compliance with applicable federal, state, or local laws, rules, regulations or standards pertaining to their businesses. In addition, Streetside does not guarantee the quality of what Merchants sell and does not independently verify, and is not liable for, representations made by Merchants regarding their products on the Platform.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside is not the retailer of any products offered by Merchants, nor is it in the delivery business or a common carrier. Streetside provides a technology platform facilitating the transmission of orders by consumers to Merchants for pickup or delivery by Couriers. Couriers are independent contractors and not employees, partners, agents, joint ventures, or franchisees of Streetside. Couriers have entered into independent contractor agreements with Streetside, which require them to comply with all applicable federal, state, and local laws, rules and regulations. Streetside shall not be liable or responsible for any delivery services provided by Couriers, or any errors or misrepresentations made by any of them. You hereby acknowledge that Streetside does not supervise, direct, control, or monitor a Courier&rsquo;s provision of services and expressly disclaims any responsibility or liability for the services performed.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside is committed to ensuring that the merchandise or food ordered by a consumer is delivered in a manner consistent with consumer&rsquo;s expectation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As provided in greater detail in these Terms, you agree and acknowledge these material terms:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The Platform is licensed, not sold to you, and you may use the Platform only as set forth in these Terms;</li>\r\n	<li>Your use of the Platform may be subject to separate third party terms of service and fees, including without limitation your mobile network operator&rsquo;s (&ldquo;Carrier&rdquo;) terms of service and fees, including fees charged for data usage and overage, which are your sole responsibility;</li>\r\n	<li>You consent to the collection, sharing, and use of your personally identifiable information in accordance with Streetside&rsquo;<a href=\"https://postmates.com/legal/privacy\" target=\"_blank\">&nbsp;Privacy Policy</a>;</li>\r\n	<li>The Platform is provided &ldquo;as is&rdquo; without warranties of any kind, and Streetside&rsquo; liability to you is limited; and</li>\r\n	<li>Disputes arising under these Terms will be resolved by binding individual arbitration.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>1. Eligibility</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You must be at least eighteen (18) years old to use the Platform. By agreeing to these Terms, you represent and warrant to us: (1) That you are at least eighteen (18) years old; (2) That you have not previously been suspended, banned, or removed from the Platform; and (3) That your registration and your use of the Platform is in compliance with any and all applicable laws and regulations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>2. Accounts and Registration</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>To access some features of the Platform, you must register for an account. When you register for an account, you may be required to provide us with some information about yourself (such as your name, credit card information, e-mail address, phone number, profile image, or other contact information). You agree that the information you provide to us is accurate, current, and complete, and that you will keep it up-to-date at all times. When you register, you will be asked to provide a password. You are solely responsible for maintaining the confidentiality of your account and password, and any password for Facebook, Google, or other third-party login when available. You accept responsibility for all activities that occur under your account. Streetside will not be liable and you may be liable for losses, damages, liability, expenses, and lawyers&rsquo; fees incurred by Streetside or a third party arising from someone else using your account due to your conduct regardless of whether you have notified us of such unauthorized use. You understand and agree that we may require you to provide information that may be used to confirm your identity and help ensure the security of your account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>3. Scope of License</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform is licensed, not sold, to you for use only under the terms of this license. Streetside reserves all rights not expressly granted to you. Subject to your complete and ongoing compliance with these Terms, Streetside hereby grants you a personal, limited, non-sublicensable, non-transferable, and revocable license to access the Platform on compatible devices that you own or control, solely for your own personal, non-commercial use, and only in a manner that complies with all legal requirements that apply to you or your use of the Platform. Streetside may revoke this license at any time, in its sole discretion.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You may not modify, alter, reproduce, distribute or make the App available over a network where it could be used by multiple devices at the same time. You may not rent, lease, lend, sell, redistribute or sublicense the App. If you breach these license restrictions, or otherwise exceed the scope of the license granted in these Terms, you may be subject to prosecution and legal damages, as well as liability for infringement of intellectual property rights. These Terms will govern any updates provided to you by Streetside that replace and/or supplement the original App, unless the upgrade is accompanied by a separate license in which case the terms of that license will govern.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>4. Payment Terms</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4.1. General Payment Terms</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Platform</em></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You understand that the prices for product or menu items displayed through the Platform may differ from the prices offered or published by Merchants for the same product or menu items and/or from prices available at other third-party websites/mobile applications. Prices for product or menu items displayed through the Platform may not be the lowest prices at which the product or menu items are sold.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Because of the nature of the Platform, Streetside does not always know how much a Merchant will charge for a particular product or menu item. Where your cart includes product or menu items for which Streetside does not know the exact price to be charged by the Merchant, Streetside may designate an estimated subtotal for such product and menu items (the &ldquo;Estimated Subtotal&rdquo;). Similarly, where Streetside does not know the exact price of certain or all fees associated with the order, including any applicable taxes and/or Streetside fees, we may designate an estimate for such fees (the &ldquo;Estimated Fees&rdquo;). If you have included product or menu items in your cart that are subject to Estimated Subtotal and/or Estimated Fees, we will provide you with an estimated total. Merchants may charge more or less than the Estimated Subtotal for products or menu items you order. Similarly, we may charge more or less than the Estimated Fees based upon the final prevailing price of Merchant&rsquo;s goods. In some cases, we may not be able to provide Estimated Subtotal or Estimated Fees, such as when the merchandise cost is unknown or we are otherwise unable to predict fees. Streetside reserves the right to determine final prevailing pricing of all product or menu items ordered through the Platform. In cases in which prevailing pricing is different than the Estimated Subtotal and/or Estimated Fees, what you are ultimately charged may be different than the estimated total. You acknowledge and agree to pay the prevailing pricing and fees, even if they differ from the Estimated Subtotal and/or Estimated Fees.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Certain features of the Platform, including placing orders, may require you to pay fees to Streetside. Streetside may change, or add, fees for use of our Platform at any time as we deem necessary or appropriate for our business, and we may incorporate certain fees into the price of products or menu items. You will have an opportunity to review and accept an estimate of the fees and other pricing that you will be charged, as applicable. The final fees may differ from the estimate. In all cases, you acknowledge and accept that a fee will be charged and you agree to pay said fee.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside has no obligation to itemize its costs, Estimated Fees, profits or margins when publishing prices on the Platform and reserves the right to change such prices at any time, at its discretion. You are liable for all transaction taxes on the Platform provided under these Terms (other than taxes based on Streetside income).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside will charge the payment method you specify at the time of purchase or as otherwise specified by you in your account information. We may also place a pre-authorization hold on your payment method, as described in Section 4.3.&nbsp;Charges paid by you are final and non-refundable, except as expressly provided in Section 4.2, and will be quoted in the local currency of the location where the order is being delivered or picked up. Except as expressly provided in Section 4.2, Streetside has no obligation to provide refunds or credits. However, Streetside, in its sole discretion, may provide consumers with refunds, courtesy delivery or product credits, or make promotional offers with different features and different rates to any consumers, which are subject to these Terms (see Credits section below).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Promotional Offers and Credits.</em></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Promotional Offers. Streetside, in its sole discretion, may make promotional offers with different features and different rates to any consumer. These promotional offers are subject to these Terms and may be valid only for certain consumers as indicated in the offer. A consumer must have a valid Streetside account with a valid form of accepted payment on file to take advantage of a promotional offer. You agree that promotional offers: (i) may only be used by the intended audience, for the intended purpose, and in a lawful manner; (ii) may not be duplicated, sold or transferred in any manner, or made available to the general public, unless expressly permitted by Streetside; (iii) are subject to the specific terms that Streetside establishes for such promotional offer; (iv) cannot be redeemed for cash or cash equivalent; (v) may only be applied if all qualifying conditions are met; and (vi) are not valid for use after the date indicated in the offer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Promotional offers can only be redeemed for Streetside orders on Streetside apps with the latest version, and within areas and times that Streetside Platform is available. Promotional offers are non-transferrable, may not be resold, and are not redeemable for cash, cash equivalent or other consideration. Offers cannot be applied retroactively for prior purchases and cannot be combined unless otherwise indicated. You agree we may change the terms and conditions of an offer, terminate an offer, or expire, withhold, deduct, limit, or modify an offer at any time for any reason. Streetside reserves the right to withhold or deduct credits or benefits obtained through a promotion in the event that Streetside determines or believes that the redemption of the promotion or receipt of the credit or benefit was in error, fraudulent, illegal, or in violation of the applicable promotion terms or these Terms. Streetside reserves the right to modify or cancel an offer at any time. The offer-redeeming consumer is responsible for paying any applicable sales tax related to the use of an offer. Streetside has no obligation for payment of any tax in conjunction with the distribution or use of any Offer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If your account is cancelled for any or no reason, you may forfeit any pending, current, or future credits or promotional offers and any other forms of unredeemed value in or associated with your account without prior notice to you.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.2. Payment Authorization</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You authorize Streetside to charge all sums for orders that you make to the payment method designated in your account. If there is a problem charging your selected payment method, we may charge any other valid payment method associated with your account. When you place an order through Streetside, a temporary pre-authorization hold is placed on your designated payment method to verify that the card is valid and has funds available for your intended purchase. The amount of this pre-authorization hold may be greater or less than the order total quoted at checkout. However, your payment will be captured up to 24 hours after your order is completed or cancelled. In the event that the pre-authorization is greater than the final amount, the difference will be released after your order is completed or cancelled; depending on your bank, it may take up to 5 business days to receive access to these released funds. In the event that the pre-authorization is lower than the final amount, we will either authorize an increase in the original amount or, if unsuccessful, we will capture the increase in amount owed by you in a second authorization.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside also places an initial temporary pre-authorization hold on each new payment method you add to your account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside reserves the right to request additional information from you if we have reason to believe, in our sole discretion, that a payment method may be fraudulent.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.3. Delinquent Accounts</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If payment due on your account is delinquent, we reserve the right to suspend or terminate your access to the Platform; your account information may be sent to a collection agency/debt collector and you may be subject to a collection action, and payment of collection related fees and costs. You will be responsible for paying all past due amounts.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If your payment card expires or is replaced by your issuing bank, the card network may provide us with updated card details associated with the same account. We may use these new details in order to help prevent any interruption to the Platform. If you would like to use a different payment method, please visit your account settings to update your billing information. In addition, we may charge another stored payment card if your default payment is declined or no longer available to us.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.4. Consumer Not Available</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Streetside reserves the right to charge you the full order amount, including any Streetside fees, if you are not at the designated delivery location when the Courier arrives to complete the delivery or if you fail to pick up an order from a Merchant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.5. Cancelled Orders</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you cancel your order, you may be charged depending on what stage the order was in when you cancelled. You will be notified of any applicable charges before you complete your cancellation.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>4.6. Returned Items</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If an item has to be returned for any reason, you may be subject to a non-refundable $15 return/restocking fee. For alcohol items, the Courier reserves the right, at his or her discretion, to refuse delivery and return the item(s) if the name on your ID does not match the name on your order, if you are not at least twenty-one (21) years old (&ldquo;Legal Age&rdquo;), if you cannot provide a bona-fide government-issued photo identification that shows you are of Legal Age, or if you are visibly intoxicated.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4.7.&nbsp;Merchant Fees</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There is no signup fee to get a Merchant account set up. For the scope of the soft launch, there will be a per order fee of $0.75 BZD for every order placed on the platform, whether pick-up or delivery. For example, Jane orders five $10 wings combo from Drey&rsquo;s wings for herself and her family, this is one order. This will be one order for five $10 wings combo. So this will help to have people bundle and get orders in bulk delivery fees will vary based on the amount. Fees will be adjusted accordingly after the launch.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4.8.&nbsp;Courier Fees</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There is no signup fee to get a Courier account set up. For the scope of the soft launch, there will be a per order fee of $0.50 BZD for every delivery on the platform. Couriers with a Service store on the platform can have a merged price of $1.25 per order made on the platform. These services include bank runs, private pickup, grocery pickup, market runs, other errands supported/specified on the platform.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>5. Third-Party Interactions</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5.1. Third-Party Providers</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>During use of the Platform, you may purchase goods and services from third-party Merchants through the Platform. Any such activity, and any interactions, disputes, terms, conditions, warranties or representations associated with that activity, is solely between you and the applicable third-party Merchant. Streetside and its licensors shall have no liability, obligation or responsibility for any purchase or transaction between you and any third-party provider. In no event shall Streetside or its licensors be responsible for any content, products, services or other materials on or available from third-party sites or third-party providers. Certain third-party providers of goods and/or services may require your agreement to additional or different terms and conditions prior to your use of or access to such goods or services, and Streetside disclaims any and all responsibility or liability arising from such agreements between you and a third party.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>5.2. Couriers</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform enables you to engage third-party Couriers to provide delivery services. Any interactions or disputes between you and a Courier are solely between you and that Courier. Streetside and its licensors shall have no liability, obligation or responsibility for any interaction between you and any Courier.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>5.3. Third-Party Advertising</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform may contain third-party advertising and marketing. By agreeing to these Terms you agree to receive such advertising and marketing.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>5.4. Third-Party Terms</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Parts of the Platform may include Google Maps features and content, including the Google Maps API(s). Your use of Google Maps is subject to the<a href=\"https://maps.google.com/help/terms_maps.html\" target=\"_blank\">&nbsp;Google Maps/Google Earth Additional Terms of Service</a>&nbsp;and the<a href=\"https://www.google.com/policies/privacy/\" target=\"_blank\">&nbsp;Google Privacy Policy</a>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>6. Your Use of the Platform</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In order to use the Platform, you agree to the following:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The Platform, including any content that forms part of the Platform, contains proprietary content, information and material that is protected by applicable intellectual property and other laws, including copyright;</li>\r\n	<li>You will not violate, or encourage others to violate, any right of a third party, including by infringing or misappropriating any third-party intellectual property right, or otherwise engage in the unauthorized use of any proprietary content, information or materials;</li>\r\n	<li>Unless expressly permitted, you may not alter, modify, create derivative works of, sell, license or in any way exploit any part of the Platform, and you agree not to copy, reproduce, distribute, publish, display, perform, transmit, stream or broadcast any part of the Platform without prior written authorization;</li>\r\n	<li>You agree not to bypass any security or other features of the Platform designed to control the manner in which the Platform is used, harvest or mine content from the Platform, or otherwise access or use the Platform in a manner inconsistent with individual human use;</li>\r\n	<li>You agree not to perform any fraudulent activity, including impersonating any person or entity, or accessing any other Platform account without permission;</li>\r\n	<li>You agree not to decipher, reverse engineer, decompile or disassemble the Platform, or the software used to provide the Platform, in whole or in part, or authorize, direct, or cause a third party to do so;</li>\r\n	<li>You agree not to use, display, mirror, frame or utilize framing techniques to enclose the Platform, or any portion thereof, unless and solely to the extent Streetside makes available the means for embedding any part of the Platform;</li>\r\n	<li>You agree not to access, tamper with, or use non-public areas of the Platform, Streetside&rsquo; (and its hosting company&rsquo;s) computer systems and infrastructure, or the technical delivery systems of Streetside&rsquo; providers;</li>\r\n	<li>You agree not to use any robot, spambot, spider, crawler, scraper or other automated means or interface not provided by us to access the Platform or to extract data;</li>\r\n	<li>You agree not to use the Platform in any manner to harass, abuse, stalk, threaten, defame or otherwise infringe or violate the rights of any other party, and that Streetside is not in any way responsible for any such use by you, nor for any harassing, threatening, defamatory, offensive or illegal messages or transmissions that you may receive as a result of using the Platform;</li>\r\n	<li>You agree that your use of the Platform may incur third-party fees, such as fees charged by your Carrier for data usage, and may be subject to third-party terms, such as your Carrier&rsquo;s terms of service, and you agree to pay all such fees and abide by all such terms; and</li>\r\n	<li>You agree not to introduce viruses, time-bombs, worms, cancelbots, trojan horses and/or other harmful code into the Platform.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Transactions involving Alcohol.</strong>&nbsp;Alcoholic beverages (including but not limited to beer, wine, cider, and spirits, as applicable; all referred to as &ldquo;Alcoholic Beverages&rdquo;) may only be purchased by consumers who are of Legal Age in jurisdictions that permit such purchase. If you are a consumer, you expressly represent and warrant that: (i) you are of Legal Age; and (ii) you will provide bona fide government-issued photo identification to your Courier upon delivery to you. Valid forms of identification include but are not limited to: (i) a valid motor vehicle operator&rsquo;s license, (ii) a passport issued by the U.S. or by a foreign government, or (iii) a valid identification card issued to a member of the Armed Forces that includes a date of birth and a picture, showing your Legal Age. Deliveries of Alcoholic Beverages may not be made to anyone who is intoxicated, regardless of his or her age. You further understand and acknowledge that neither Streetside nor the Courier can accept your order of Alcoholic Beverages, and the order will only be delivered if the third-party Merchant accepts your order.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You agree not to do any of the acts described in this Section 6, or to assist or permit any person in engaging in any of the acts described in this Section 6.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>7. Consent to Use of Data</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please see Streetside&rsquo;s Privacy Policy, for more information regarding information Streetside collects, and how it uses and shares that information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have previously instructed Streetside to share your personal information with a Merchant or any other third party, you can elect to discontinue such sharing by directly messaging any of the social media pages or contact information provided on the website.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>8. Intellectual Property Ownership</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform, and the media and materials contained in the Platform, including all intellectual property rights in the Platform, are the sole and exclusive property of Streetside and its licensors. Except for the limited license expressly granted by and to you under these Terms, no other rights, licenses, or immunities are granted or shall be deemed to be granted under these Terms, either expressly, or by implication, estoppel or otherwise. All rights not expressly granted by Streetside in these Terms are expressly reserved.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>9. Content You Provide through the Platform</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>9.1. Content You Provide</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You may be able to submit, post, upload, denote, or otherwise make available (collectively, &ldquo;Post&rdquo;) photographs, video clips, reviews, ratings, favorites, liked items, bookmarked Merchants, questions, comments, public messages, ideas, designs, concepts, inventions, feedback, and other content (collectively, &ldquo;User Content&rdquo;) (that may or may not be viewable by other users) through the Platform or through other communications with you, including, without limitation, through text (&ldquo;SMS&rdquo;) or multimedia (&ldquo;MMS&rdquo;) messages (&ldquo;Interactive Areas&rdquo;).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>9.2. Use of Your Content</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You acknowledge that when you Post User Content on or through the Platform, the User Content shall be deemed, and shall remain Streetside&rsquo;s property. Streetside does not provide any compensation for User Content that you Post on or through the Platform. You agree that User Content that you Post on or through the Platform shall be deemed to be non-confidential and non-proprietary, and Streetside shall have no obligation of any kind with respect to such information. When you Post User Content on or through the Platform, you grant Streetside a world-wide, perpetual, irrevocable, royalty-free, non-exclusive, and sub-licensable license to use, copy, distribute, reproduce, modify, edit, adapt, publicly perform, publicly display, translate, create derivative works from, sell, lease, transmit, communicate to the public, disassemble, and publish such User Content in connection with Streetside&rsquo; or its partners&rsquo; or affiliates&rsquo; business, in whole or in part, in any format or medium now known or developed in the future, for any purpose whatsoever, unless expressly agreed otherwise in writing by Streetside, including without limitation for promoting and redistributing part or all of the Platform (and derivative works thereof) in any media formats and through any media channels. You further grant Streetside a license to use your username and/or other user profile information, including, without limitation, your ratings history and how long you have been a Streetside consumer, to attribute User Content to you, if we choose to do so. Further, Streetside shall be free to use any ideas, concepts, know-how or techniques contained in User Content for any purpose whatsoever in connection with our business or the business of our partners or affiliates, without notice to, approval by, or compensation to you, including but not limited to developing, manufacturing and marketing products incorporating such information. In the interest of clarity, the license granted to Streetside shall survive termination of the Platform or your account. Notwithstanding the foregoing, our use of your personal data shall be governed by the Streetside Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>9.3. User Content Representations</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You acknowledge and agree that all User Content that you Post is your sole responsibility. You represent that you have all required rights to Post or transmit such User Content without violation of any third-party rights. You understand that Streetside does not control, and is not responsible for, User Content, and that by using the Platform, you may be exposed to User Content from other users that is offensive, indecent, inaccurate, misleading, or otherwise objectionable. Please also note that User Content may contain typographical errors, other inadvertent errors or inaccuracies. You agree that you will indemnify, defend, and hold harmless Streetside for all claims resulting from User Content you Post. We reserve the right, at our own expense, to assume the exclusive defense and control of such disputes, and in any event you will cooperate with us in asserting any available defenses.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>9.4. User Content Review</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You acknowledge and agree that Streetside and its designees may or may not (but do not assume any obligation to), at Streetside&rsquo; discretion, pre-screen User Content before its appearance on the Platform. You further acknowledge and agree that Streetside reserves the right (but does not assume the obligation) in its sole discretion to reject, move, edit or remove any User Content that is contributed to the Platform. Additionally, Streetside has the right to remove any User Content that violates these Terms or is otherwise objectionable in Streetside&rsquo; sole discretion. You acknowledge and agree that Streetside does not verify, adopt, ratify, or sanction User Content, and you agree that you must evaluate and bear all risks associated with your use of User Content or your reliance on the accuracy, completeness, or usefulness of User Content.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>9.5. Ratings and Reviews</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Platform and other Interactive Areas may allow you to rate (&ldquo;Ratings&rdquo;) and Post reviews (&ldquo;Reviews&rdquo;) of Merchants. Such Ratings and Reviews are considered User Content and are governed by these Terms, including, without limitation, your agreement regarding your use of the Platform (Section 6). Ratings and Reviews are not endorsed by Streetside, and do not represent the views of Streetside or of any affiliate or partner of Streetside. Streetside does not assume liability for Ratings and Reviews or for any claims, liabilities, or losses resulting from any Ratings and Reviews. We strive to maintain a high level of integrity with our Ratings and Reviews and other User Content. Therefore, all Ratings and Reviews must comply with the following criteria: (1) you must have had first-hand experience with the Merchant within the 7-day period prior to your Posting a Rating or Review; (2) you may not have a proprietary or other affiliation with either the Merchant or any of its competitors; (3) you may not draw any legal conclusions regarding the Merchant&rsquo;s products, services, or conduct; (4) you may not promote or criticize a Merchant other than the one being rated or reviewed; (4) you may not include others&rsquo; personal information; and (5) your Rating or Review must otherwise comply with these Terms. Any Rating and/or Review that we determine, in our sole discretion, could diminish the integrity of the Ratings and Reviews, and/or the Platform may be removed or excluded by us without notice.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>&nbsp;</strong></h3>\r\n\r\n<h3><strong>10. Communications</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>10.1. Text Messaging</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>By using the Platform, you understand and agree that Streetside and those acting on its behalf may send you text (SMS) messages (potentially including messages generated using an automatic telephone dialing system) at the phone number you provided us. These messages may include operational messages about your use of the Platform, as well as marketing or other promotional messages. You will not be able to use the Platform without agreeing to receive operational text messages. Your agreement to receive marketing texts is not a condition of any purchase or use of the Platform. If you change or deactivate the phone number you provided to Streetside, you must update your account information to help prevent us from inadvertently communicating with anyone who acquires your old number. Standard data and message rates may apply for SMS and MMS alerts, whether you send or receive such messages. Please contact your Carrier for details.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>10.2. Push Notifications</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When you install our App on your mobile device you agree to receive push notifications, which are messages an app sends you on your mobile device even when the app is not on. You